(5059, 96209215, 2147483647, 'Cho thuê phòng chính chủ tại Ngõ Giảng Võ HN', 'Cho thuê phòng trọ tại: \n✅ Địa chỉ: Ngõ 45 Giảng Võ, Cát Linh Đống Đa, Hà Nội. \n✅ Diện tích từ 15 - 20 m2 \n✅ Giá thuê: 2tr _ 2tr5 (chưa bao gồm điện, nước, wi-fi)\n\nPhòng thoáng mát, ốp lát sạch sẽ, điện nước đầy đủ, an ninh tốt. Có wifi, bình nóng lạnh, điều hòa khu bếp nấu ăn. Gần chợ, gần bến xe buýt Kim Mã, gần tàu điện trên cao Cát Linh-Hà Đông, gần các trường Đại học Văn hóa, Nhạc viện Hà Nội, Cao đẳng Y Đại học Mỹ thuật....\n\nLiên hệ chị Thảo \nMIỄN TRUNG GIAN \n❗Ưu tiên cho con gái là sinh viên và người đang đi làm', 1050, 75, 2200000, '5d14e1e24a0402dd1adcfb8365731c85-2778017174222994551.jpg', 0, '', '21.02483,105.82257', '[{\"id\":\"size\",\"value\":\"18 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:09'),
(5060, 95544812, 2147483647, 'Căn hộ Cầu Giấy , 1 ngủ  1 khách / Dương Quảng Hàm', 'CHUNG CƯ MINI 79 Dương Quảng Hàm - CẦU GIẤY !!!\n? Riêng Biệt - Không Chung Chủ \nCăn hộ CCMN Cầu Giấy : 1 Ngủ - 1 Khách - Ban Công ...\n        4tr5 - 5tr - 5tr5   ( Cơ bản - Full Đồ ) \n✅( Nguyễn Khánh Toàn / Dương Quảng Hàm / Nguyễn Văn Huyên / Discovery / Bamboo Airway )\n✅ Diện tích 35 - 40 m2 : 1 Ngủ / 1 Khách / 1-2 Ban công\n✅ GẦN : ĐHQG , ĐH sư phạm, HV Báo chi , ĐH Thủ Đô ...\n✅ GẦN : TTTM Discovery , Bamboo Airway , Vinmart , CHợ .....\n?? Địa chỉ : Số nhà 22 Ngõ 79/24 Dương Quảng Hàm - Cầu Giấy ( 85 Nguyễn Văn Huyên ) \nChính chủ : *** ( Hoàng )\n( Miễn trung gian - Xem nhà thoải mái )', 1010, 79, 5000000, 'e64b6ff94a83be61600c182af43232ea-2775058655657724567.jpg', 1, '', '21.0337,105.79848', '[{\"id\":\"size\",\"value\":\"40 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:09'),
(5061, 96174501, 2147483647, 'Phòng trọ 34 Nguyễn Văn Linh, P.Tân Thuận Tây, Q7', 'Tôi cần cho thuê phòng trọ địa chỉ 34 Nguyễn Văn Linh, phường Tân Thuận Tây, Quận 7, gần KCX Tân Thuận, cảng Bến Nghé, gần chợ, yên tĩnh, an ninh.\nCó sân rộng, thoáng mát mặt tiền.\n- Chúng tôi có phòng cho thuê rộng rãi 20m2, có thể ở từ 2 người , có toilet riêng trong phòng, có chỗ phơi đồ riêng, cửa sổ phòng thoáng mát.\n- Tiện ích bao gồm: Wifi, cáp, rác,... Chỗ để xe miễn phí, giờ giấc tự do.\n- Giá điện: 3.500đ/kwh.\n- Giá nước: 20.000đ./ khối\n- Giá phòng: 2.5 triệu/tháng\nƯu tiên người lịch sự đến trước chọn phòng đẹp.\nChủ nhà vui vẻ hòa đồng.', 1050, 102, 2500000, 'ba8a3fe9eb9bad996e290bcfb2cda216-2777874426195919083.jpg', 0, '', '10.75089,106.72369', '[{\"id\":\"size\",\"value\":\"20 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:09'),
(5062, 96012307, 2147483647, 'Nội Thất Cơ Bản, 6x20, 1Lửng 2PN 2WC 300m ra BX Q8', '☎ ZALO: *** -> ĐỂ XEM VIDEO + Đầy Đủ nhà Q8.\n\n✅ 6x20m - 1TRỆT 1Lửng - 2PN 2WC 1Bếp 1PK. Mới 100%. Đường: Rộng 6m, phù hợp Văn Phòng Cty, ở Gia Đình  . \n\n✅ Phù Hợp: gia đình, cty, k.doanh online,...\n\n✅ Gần: cầu Nhị Thiên Đường, chợ Bùi Minh Trực, di chuyển Q1, 3, 4, 5, 6, 7,... dễ dàng.\n\n✅ Điện nước giá Nhà Nước. Không phí gì khác :))\n\n✅ Dân cư an ninh. Tiện ích: Trường học (mầm non, cấp 1,2,3, Đại Học/Cao Đẳng), gần chợ, nhà sách, gym, cafe. \n\nRÕ RÀNG - ĐÚNG NHÀ\n*** Ký Gửi Mua bán/Cho thuê BĐS Quận 8\nMobi:    *** (Zalo/Viber)\n\n?Bạn Cần:\n- Mở Văn phòng, bưu cục, cafe, quán ăn,...\n- Nha Khoa, Kinh doanh online, Kho bãi,...\n- Ở gia đình: CHAT Zalo để được hỗ trợ nhé. \n\nCho thuê nhà Phạm Hùng, Âu Dương Lân, Dương Bá Trạc, Cao Lỗ, Phạm Thế Hiển, Hưng Phú, Nguyễn Duy,...', 1020, 103, 13000000, 'defa71cb12aa0f383dda344d2a165a6e-2777140816303485874.jpg', 2, '', '10.73611,106.6562', '[{\"id\":\"size\",\"value\":\"120 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:09'),
(5063, 96209199, 2147483647, 'cho thuê mặt tiền kinh doanh quận. 12', 'Mặt tiền kinh doanh đường thạch lộc 19.\nNhà đang xây dựng \nNgay chợ, sầm uất.\nChính chủ mong muốn thuê lâu dài', 1030, 107, 12000000, 'a09212e30d4171d4bc4db0c243cb2631-2778017355691431716.jpg', 0, '', '10.86983,106.68936', '[{\"id\":\"size\",\"value\":\"100 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:09'),
(5064, 90316942, 2147483647, 'CHO THUÊ 5 P TẠI CHUNG CƯ HAGL2.Q.7. TỪ 2.5-4.5 Tr', 'Cần cho thuê 5 phòng tại căn hộ chung cư HAGL 2, Q.7 GIÁ 2.5-4.5 Tr\n(tuỳ diện tích) tại căn hộ chung cư Hoàng Anh Gia Lai 2, P. Tân Hưng, Q. 7.\nCăn hộ nằm ngay trung tâm quận 7; 5 phút lên tới q.1,3,4,5,8. \nPhòng mới sữa chữa,  sạch sẽ đủ nội thất,đồng hồ điện riêng\nTự do sử dụng tủ lạnh, phòng bếp, máy giặt\nGiờ giấc thoải mái\nƯU TIÊN NỮ, Ở GỌN GÀNG\nP/s::: do tình hình dịch\nNên có thể ký NGẮN HẠN\n?3-6 tháng?', 1050, 102, 4000000, '64e9a488bc925fc189be7512b742fc9b-2749528258714003469.jpg', 0, 'Đường Trần Xuân Soạn', '10.75097,106.70711', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:10'),
(5065, 96209170, 2147483647, 'Phòng Wc Riêng Full Nội Thất Free GởiXe Giá rẻ cực', 'Cho thuê phòng tại địa chỉ đường Phùng văn cung, Phú Nhuận ,Phường 7 sát bên thiên đường ẩm thực phan xích long vị trí trung tâm nên đi bình thạnh hay gò vấp đều ổn . Giờ giấc tự do không giới hạn người ở . Có wc riêng dùng chỉ 1 mình 1 phòng .\n- Full nội thất ( Máy lạnh, tủ lạnh, nước nóng , có cửa sổ thông thoáng).\n- khu bếp chung ( có lò vi sóng ), Máy Giặt chung, có người dọn vệ sinh hàng tuần )\n- Phí : Điện 3,5k/kwh, nước 100k/phòng, Dịch vụ 120k/phòng.\n- GIÁ CHỈ TỪ : 3 triệu 900 \n- Có thể nhận phòng liền vào ở ngay .\n? Gần và tiện di chuyển sang Q1 , Q3 , BT chỉ hơn 10 phút\n❌ GIỜ GIẤC TỰ DO - KHÔNG CHUNG CHỦ\n?Giá chỉ 3 triệu 900\n⚡️Điện : 3,5k\n?Nước : 100k/1 người\n?Xe : Free (2 chiếc)\n♻️ Wifi,vệ sinh chung,rác: 120k/p\n\n?FULL NỘI THẤT NHƯ HÌNH NHÉ XIN CAM KẾT KHÔNG ĐÚNG HÌNH MÌNH HOÀN TIỀN GẤP ĐÔI ( Không thu thêm bất kỳ phí gì ngoài những phí nêu trên )\n———————————\n☎️ Liên hệ : ***(Mr Hiếu )\n: *** (Add Zalo) để được tư vấn và hỗ trợ tìm phòng phù hợp với bạn.', 1050, 111, 3900000, '28b44d28a8f9fec7f5ca01c9b0a4bc70-2778017546442250530.jpg', 0, '', '10.8012,106.68563', '[{\"id\":\"size\",\"value\":\"20 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:10'),
(5066, 88848110, 2147483647, 'CHO THUÊ CĂN HỘ+STUDIO- SUNRISE CITY VIEW Giá Tot', 'Cho thuê OFFICETEL+  Căn Hộ 1PN + 2PN + 3PN  Sunrise City, Nguyễn Hữu Thọ, Quận 7.\n\nSẽ cố gắng thương lượng giá tốt cho khách thiện chí thuê.\n\nThông Tin Căn Hộ: Nhà Trang Bị Đầy Đủ Nội Thất, View Đẹp Thoáng Mát.\n\n+ Căn hộ 1PN: Giá 7tr đến 10 tr/th (36m2, 56m2, 69m2).\n\n+ Căn hộ 2PN: Giá 12tr tr đến 15 tr/th (76m2, 99m2).\n\n+ Căn hộ 3PN: Giá 16 tr đến 19tr/th (99m2, 105m2, 115m2).\n-\nĐầy đủ tiện ích 5 sao, cao cấp khu Nam Sài Gòn.\n- Hồ bơi tràn bờ.\n- Phòng tập gym, sân tennis.\n- Spa thư giãn.\n- Trung tâm thương mại.\n- Dịch vụ: Spa, nhà trẻ, nhà thuốc.\n- An ninh tuyệt đối.\n- Có khu vui chơi cho trẻ em, công viên thông thoáng, mát mẻ, view đẹp.\n- Khách hàng thoải mái lựa chọn căn hộ phù hợp theo nhu cầu của mình.\n- Tư vấn nhiệt tình dẫn khách đi xem trực tiếp căn hộ, nắm nhiều key nên có thể xem nhà bất cứ lúc nào.\n- Hỗ trợ thương lượng trực tiếp với chủ nhà để có giá tốt nhất.\n- Hỗ trợ nhanh, gọn mọi thủ tục sang nhượng và giấy tờ pháp lý, tạm trú, tạm vắng.\n- Tư vấn nhiệt tình, làm việc uy tín và có trách nhiệm.\n- Nắm nhiều key, xem nhà ngay.\n- Cam kết thông tin cập nhật nhanh nhất, mới nhất, chính xác nhất.\nLiên hệ xem nhà : Hậu zalo\nCảm ơn anh chị đã xem tin', 1010, 102, 8000000, 'a4ab840ee09798cf9d55d6f9f04938fe-2742704350441837675.jpg', 2, 'Đường Nguyễn Hữu Thọ', '10.70385,106.71276', '[{\"id\":\"size\",\"value\":\"76 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:10'),
(5067, 95911137, 2147483647, 'Nhà phố liền kề Nine South 4PN 140m2,Nhà Bè', '???Khu Dân Cư NINE SOUTH - (NAM SÀI GÒN)???\n?cho thuê 24tr/tháng.\n\n? Diện tích : 7 x 20 m (140m2)\n? Xây dựng : 1 trệt, 2 lầu.\n? Kết cấu : Trệt, 2 lầu, giao hoàn thiện mặt ngoài. Có nội thất xinh xinh.\n? Thiết kế: sân ? trước, sau, phòng khách , nhà ăn , 4pn , 4 tolet , phòng thờ , phòng giặt, sân thượng ...\n? Vị trí: Mặt tiền đường số khu dân cư, liền kề LAVILA và GS METRO CITY HÀN QUÔC.\n\n_____?⬇️⬇️?____\n☎️ ???̂? ??̣̂: hotline\n? ??̣? ???̆́? ??̆́? ??? ??? ??̀?? ???̂? ??̣̂ ???̣̆? ??̂́? ??̣? ???? đ?̂̉ đ?̛?̛̣? ??̛ ??̂́? ??̣̂? ??̀?? ??̀ ??? đ?́? !', 1020, 118, 24000000, '65cea583f0dff885b1fdf18d9399090c-2776721758407644320.jpg', 4, 'Đường Nguyễn Hữu Thọ, Xã Phước Kiểng, Huyện Nhà Bè, Thành phố Hồ Chí Minh', '10.70387,106.71276', '[{\"id\":\"size\",\"value\":\"140 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"4 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:10'),
(5068, 95817104, 2147483647, 'Phòng Master CC Phú Hoàng Anh Gần ĐH RMIT, TĐT', 'Cho thuê phòng master chung cư Phú Hoàng Anh gần ĐH RMIT, TĐT \n\nDiện tích: 30m2 - Giá 5,2tr/ tháng\n\nTiện ích:\n\n️ Full nội thất như : gường , nệm , ga phủ , máy lạnh , tủ quần áo, bàn, ghế ...có toilet riêng trong phòng.\n\n️ Full tiện ích trong khu như khuôn viên rộng rãi ,hồ bơi ,  phòng gym, BBQ ngoài trời, BV 24/24, an ninh tuyệt đối, , tầng hầm để xe rộng (xe hơi đậu thoải mái), các dịch vụ nhà trẻ, quán ăn, spa ...\n\n️ Có dọn dẹp vệ sinh khu sinh hoạt chung 2 lần/ tuần\n\n️ Có kĩ thuật sửa chữa và bảo trì miễn phí các hê thống thiết bị trong căn hộ.\n\n️ Điện nước tính theo đơn giá của nhà nước\n\n️ Phí Dịch Vụ : 170K/ Tháng, Xe 100K/ Chiếc, Wifi 60K/ Tháng.\n\n️ Nhà bếp đủ đồ dùng, máy giặt, tủ lạnh cao cấp ...\n\nNằm ngay khu dân cư đông đúc, sầm uất ... thuận tiện di chuyển qua các quận trung tâm\n\nTất cả đều đã sẵn sàng xách vali vào ở thôi ạ\n\nLiên hệ: ***(Zalo/Mess)\n\nNOTE: Hình ảnh thực tế của phòng cho thuê.', 1050, 118, 5200000, '1f66957e617f7f6e18589c1fc8e2c7b6-2776268168216972373.jpg', 0, '', '10.70387,106.71276', '[{\"id\":\"size\",\"value\":\"30 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:10'),
(5069, 94364979, 2147483647, 'Phòng 281/41 Lê Văn Sỹ. Có nhà xe. Nội thất đủ', '☔️Vị trí ngay 281/41 Lê Văn Sỹ, phường 1, Tân Bình\n☄️Gần vòng xoay cầu vượt Cộng Hoà, sân bay, công viên Hoàn Văn Thụ…. Trung tâm Tân Bình. Đi về Phú Nhuận, Quận 10, Q1 chưa tới 5 phút. Góc giao Hoàng Sa, Lê Văn Sỹ và Đặng Văn Ngữ. Đi đâu cũng tiện.\n\n☀️Phòng ban công lớn, nội thất full, bếp, wc trong, máy giặt riêng. Hình thật 100%. \n?Ra vào vân tay tự do, không chung chủ, để xe dưới nhà\n\n⚜️Giá 4tr2. Thương lượng. Rẻ nhất khu vực. \n??Liên hệ xem phòng ngay. Vui lòng gọi trước', 1050, 112, 4200000, '56fcd61ff728b5f1e3ce790105a0ee25-2776810539778601904.jpg', 0, '', '10.79551,106.66662', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:11'),
