(5071, 94628607, 2147483647, 'Phú mỹ hưng Quận 7 căn Studio bao điện nước 7tr', 'Trung tâm Phú mỹ hưng Quận 7\n???CHDV cho thuê dài hạn/ngắn hạn\n? Giá BAO ĐIỆN NƯỚC TRỌN GÓI ?\n? TRỌN GÓI CHO 1 NGƯỜI ?\nPhù hợp cho freelancer, làm việc tại nhà và người hay quên tắt điện. FULL nội thất, có bếp từ, có cửa sổ, giặt phơi sân thượng.\n☑️ Studio??đầy đủ nội thất??có bếp từ, máy hút mùi??cửa sổ thoáng.\n☑️ Không chung chủ, đi thang máy, camera, lễ tân 24/7, ra vào tự do\n☑️ FREE dọn 1 lần mỗi tuần.\n☑️ FREE giặt phơi sân thương.\n?Giá thuê từ 7,000,000 đến 9,000,000 TRỌN GÓI CHI PHÍ.\n?CỌC 1 THÁNG?\n?Hệ thống còn vài căn 1PN / STUDIO / DUPLEX có ban công máy giặt cần đi gấp, giá đi nhanh từ 6,xxxtr??\n? GIÁ CHUẨN HÌNH THẬT ?% tránh mất thời gian của cả 2 bên?\n☎️ Call / Zalo/ Fb: SĐT Gặp Quân để được tư vấn và book lịch xem phòng nhé', 1010, 102, 7000000, '039675b16ef0d93aaf143148e71ce5f7-2771004817115175731.jpg', 1, '', '10.732,106.70948', '[{\"id\":\"size\",\"value\":\"27 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:11'),
(5072, 94443843, 2147483647, 'CHO THUÊ SHOPHOUSE CH RICCA, 2 tầng.Tặng PHÍ QL.', 'Cho thuê SHOPHOUSE căn hộ chung cư RICCA, đường GÒ Cát, quận 9, căn hộ mới bàn gi thông tin như sau:\n\n+ Diện tích: 133m2, có 2 tầng, 1WC, hướng cửa chính: TÂY_ BẮC, thuận tiện cho kinh doanh nội khu và ngoại khu, hướng cửa tầng 2   view hồ bơi. Thuận tiện kinh doanh nội khu.\n\n+ Nội thất cơ bản chủ đầu tư bàn giao.\n+ TẶNG PHÍ QUẢN LÝ ĐẾN HẾT NĂM.\n\n+ Diện tích mặt tiền thông thoáng, cư dân đông đúc thích hợp cho kinh doanh hoặc mở văn phòng.\n\n+ Tiện ích nội khu: Hồ bơi rộng 1200m2, phòng Gym, khu vui chơi trẻ em, vườn BBQ, sân thể thao đa năng.\n+ Tiện ích ngoại khu: Ngân hàng Sacombank, siêu thị Vinmart, Bách hoá xanh, Pharmacity, chợ, UBND Phường, trường học liên cấp, và rất nhiều quán ăn, cà phê.\n* Thuận tiện cho việc di chuyển:\nĐi Khu Công Nghệ cao khoảng 05 phút.\nĐi trung tâm hành chính quận 2 khoảng 15 phút.\nĐi trung tâm quận 1 khoảng 20 phút.\n+ GIÁ THUÊ CHỈ VỚi: 17 triệu/ tháng.\nHãy gọi cho em sớm để được tư vấn xem nhà. (Em. Phú).', 1010, 119, 17000000, 'f1b9bd2e817bba05183705af708737a7-2774488335005655836.jpg', 1, 'Đường D7, Gò cát', '10.79052,106.80096', '[{\"id\":\"size\",\"value\":\"133 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:11'),
(5073, 95747713, 2147483647, 'Cho thuê phòng trọ có gác ở 4ng/4xe Lý Phục Man Q7', 'Cuối tháng mình trống phòng như hình ở Lý Phục Man, phường Bình Thuận, quận 7\nPhòng có nội thất máy lạnh, tủ quần áo, kệ giày dép, kệ bếp, nhà vệ sinh riêng. \nCho thuê tủ lạnh có tính phí 200k/ tháng.\nCó dịch vụ máy giặt chung 8kg/kg, phơi đồ sân thượng, hầm gửi xe, thang máy, bảo vệ 24/24, giờ giấc tự do, kh chung chủ\nCho nuôi pet nhỏ\nPhòng có gác ở được 4 bạn/ 4 xe\nMình còn nhiều phòng giá rẻ từ 3tr3 ib ngay nha\n?LH (Khánh Hoà) tư vấn tìm phòng theo yêu cầu MIỄN PHÍ!!', 1050, 102, 4200000, 'd71f24519793cd70f5aac90cf33454db-2775973782028805066.jpg', 0, '', '10.7431,106.72563', '[{\"id\":\"size\",\"value\":\"40 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:11'),
(5074, 93732143, 2147483647, 'CĂN HỘ BAN CÔNG 30m2 FULL NỘI THẤT LÝ THƯỜNG KIỆT', 'Địa chỉ : 324/19 Lý Thường Kiệt, phường 14, quận 10\n+ Đối diện nhà thi đấu Phú Thọ\n+ Diện tích: 30m2, được bố trí full nội thất hiện đại, tiết kiệm điện năng.\n+ Tọa lạc trong khu dân trí cao, an ninh, cư dân trong tòa nhà đa số là dân văn phòng\n+ Môi trường sống trí thức, hiện đại\n\nGiá thuê : 7.500.000/tháng\nTiện nghi căn phòng cực kỳ cao cấp, tất cả được bày biện một cách hợp lí, không gian bếp ngăn cách với gian bếp\n-Phòng thiết kế tinh xảo, nội thất gỗ hương cao cấp\n-Full nội thất, thiết bị TỐI TÂN, hiện đại.\n- Có kệ bếp nấu ăn hiện đại.\n- Máy lạnh Panasonic New 100%\n- Nội thất cơ bản: Tủ lạnh, tủ đồ, giường nệm, TV 32inch,\n- Bàn ghế ăn bằng gỗ, máy nước nóng Năng Lượng Mặt Trời\n- Có chỗ để xe rộng rãi\n- Giờ giấc tự do 24/24.\n- Máy giặt riêng trong phòng, quá tiện nghi sử dụng.\n- Wifi tốc độ cao, thang máy sử dụng miễn phí.\n-ĐẢM BẢO MÔI TRƯỜNG SỐNG AN NINH, ĐẦY ĐỦ.\n-Thang máy lớn, tốc độ nhanh.\n-Hệ thống báo cháy tự động, chữa cháy thông minh, hiện đại an toàn chuẩn quốc tế\n\nTất cả tiện nghi đã sẵn sàng chào đón các vị khách mới cho căn phòng tuyệt vời này\nChỉ còn 1 phòng \nGọi ngay Mr Khánh (call, sms, zalo,...24/7) để được hổ trợ xem phòng và dọn vào ở ngay', 1010, 105, 7500000, 'b6d366416a0ef180afaa22f7fcb807ee-2766839523005167793.jpg', 1, 'Đường Lý Thường Kiệt', '10.78589,106.65378', '[{\"id\":\"size\",\"value\":\"30 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:12'),
