(5087, 96209011, 2147483647, 'Cho thuê nhà mới tinh Mỹ Đình 3 ngủ đủ đồ', 'CHO THUÊ NHÀ NGUYÊN CĂN MỸ ĐÌNH NAM TỪ LIÊM\n_ Địa chỉ: Ngõ 394 Mỹ Đình gần Kangnam\n_ Nhà mới koong chưa có người ở.\n* Diện tích: 35m2\n* Thiết kế 5 tầng, hiện đại nhất xu hướng hiện nay.\n*Tầng 1: Phòng Khách + bếp.\n* Tầng 2: Phòng ngủ + WC\n* Tầng 3 : Phòng ngủ + WC\n* Tầng 4: Phòng ngủ + WC\n* Tầng 5: Phòng thờ + sân phơi\n- Nội Thất full đồ như ảnh và video\n- Nhà ưu tiên hộ gia đình và nhóm.. ( không  cho kinh doanh)\nBên ngoài ngõ quẹt thẻ từ mới được vào, đảm bảo an ninh. \n- Giá thuê 15tr ( có thương lượng )\n- TT 3-6 tháng cọc 1', 1020, 121, 15000000, '91e96a85fb5991734598c3d6e8ccd7f3-2778015527020599586.jpg', 0, '', '21.02742,105.77438', '[{\"id\":\"size\",\"value\":\"35 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"3 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:16'),
