(5102, 95181705, 2147483647, 'HỖ TRỢ CỌC GÁC CỬA SỔ NỘI THẤT UFM TDTU RMIT QUẬN7', 'KHAI TRƯƠNG PHÒNG CÓ GÁC CAO PHÒNG RỘNG 30m2 ?\n\nĐịa chỉ: Lâm Văn Bền, phường Tân Kiểng, quận 7\n\n? Nội thất bao gồm: máy lạnh, máy nước nóng, tủ quần áo,.. thêm nội thất khác thêm phí\n\nVị trí vô cùng tiện lợi khi di chuyển sang quận 1, quận 8, quận 5, quận 2\n\nCó thang máy, hầm gửi xe, máy giặt chung, KHU VỰC AN NINH \nNỘI THẤT MỚI TOANH \nGIỜ GIẤC TỰ DO \nCỬA SỔ THOÁNG MÁT \nTIỆN NGHI TIỆN ÍCH XUNG QUANH \n\n??? \n‼️ Hỗ trợ tìm phòng trọ toàn bộ Sài Gòn', 1050, 102, 4500000, 'b138b8a414c36f695959e8a463dc4f4c-2777722765453927472.jpg', 0, '', '10.7487,106.71418', '[{\"id\":\"size\",\"value\":\"30 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:20'),
(5103, 96208929, 2147483647, 'NHẬN PHÒNG CÓ NGAY 1 TRIỆU TIỀN MẶT CHO 2 KHÁCHĐẦU', '+ CHÍNH CHỦ mình vừa mới hoàn thiện xong 1 tòa nhà cao tầng mới 100% đang đi vào hoạt động 7 phòng CHDV tại địa chỉ đường Hoàng Hoa Thám, Bình Thạnh ,Phường 5 sát bên chợ cây quéo vị trí trung tâm nên đi bình thạnh hay gò vấp đều ổn . Giờ giấc tự do không giới hạn người ở .\n- Full nội thất ( Máy lạnh, tủ lạnh, nước nóng).\n- khu bếp chung ( có lò vi sóng ), Máy Giặt chung, wc chung ( 2pn - có người dọn vệ sinh hàng tuần )\n- Phí : Điện 3,5k/kwh, nước 100k/phòng, Dịch vụ 120k/phòng.\n- GIÁ CHỈ TỪ : 3 triệu 900 - 4 triệu 3 / phòng ( Tặng LỘC 1 triệu TIỀN MẶT cho 2 bạn vào thuê đầu tiên của căn nhà này )\n- Có thể nhận phòng liền vào ở ngay .\n? Gần và tiện di chuyển sang Q1 , Q3 , BT chỉ hơn 10 phút\n❌ GIỜ GIẤC TỰ DO - KHÔNG CHUNG CHỦ\n?Giá chỉ 3 triệu XXX\n⚡️Điện : 3,5k\n?Nước : 100k/1 người\n?Xe : Free (2 chiếc)\n♻️ Wifi,vệ sinh chung,rác: 120k/p\n\n?FULL NỘI THẤT NHƯ HÌNH NHÉ XIN CAM KẾT KHÔNG ĐÚNG HÌNH MÌNH HOÀN TIỀN GẤP ĐÔI ( Không thu thêm bất kỳ phí gì ngoài những phí nêu trên )\n———————————\n☎️ Liên hệ : ***(Mr Hiếu )\n: *** (Add Zalo) để được tư vấn và hỗ trợ tìm phòng phù hợp với bạn.', 1050, 111, 3900000, 'e39fb3ce0ae2585466ebeba2ac299ae7-2778015583090841890.jpg', 0, '', '10.81028,106.68309', '[{\"id\":\"size\",\"value\":\"20 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:20'),
(5104, 96208927, 2147483647, 'TÌM NỮ Ở GHÉP', 'TÌM NỮ Ở GHÉP - Đường Số 2 NGUYỄN KIỆM P3 GÒ VẤP? \n\n-Hiện phòng còn khá rộng nên mình cần tìm 1-2 bạn nữ vào ở cùng.\n-Giá phòng 4tr chia ra điện 3k nước 20k/khối\nWifi rác có sẵn. Đầy đủ nội thất. Trên lầu có máy lạnh.Bạn chỉ cần đem đồ cá nhân vào ở. ??\n\n- Vị trí địa lý: GẦN\n   + Chợ Sân Tơn Nhất, Đại Học Mở, Nguyễn Kiệm, Ngã 5 chuồng chó, Lotte, Coopmart, Bệnh Viện 175 (<500m)\n   + Gần Sân Bay, ĐH Công nghiệp, Công Viên, Emart, Phạm Văn Đồng... bán kính 1km\n\n- Không gian Phòng:\n+Hai lầu có ban công,rộng thoáng mát\n+ Mát mẻ, sạch sẽ\n+ Không chung chủ, giờ giấc tự do\n+ Chỗ để xe rộng rãi, thoáng mát\nIb mình để xem hình phòng nha.', 1050, 110, 4000000, '38b99e63ad81d96856c420fcc15f7d33-2778015541301676536.jpg', 0, '', '10.82172,106.6767', '[{\"id\":\"size\",\"value\":\"20 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:20'),
