(5109, 93460357, 2147483647, 'Hình thật giá thật?ban công gần Lotte?Hỗ trợ cọc', 'Phòng đẹp thì giá cao❗️\nPhòng giá vừa túi thì ko vừa ý❗️\nLàm sao tìm được phòng đây trời???\n\n ? CAM KẾT CỦA MÌNH?\n✔️ Giá phòng cạnh tranh chỉ 5-6TR\n✔️ Hình thật, giá thật - Tôn trọng khách hàng\n✔️ Tiện ích cao cấp, dịch vụ bảo vệ, quản lý chuyên nghiệp, máy giặt riêng trong phòng\n\nGiá phòng:\n- Mặt trước: 5.8-6TR\n- Mặt sau: 5.5-5.7TR\n\n??? Bạn còn băn khoăn? Sao ko liên hệ Nhung ngay để làm rõ? ??', 1010, 102, 5500000, '5f17212949d87f4363124399a66cd657-2777114806349021084.jpg', 1, '', '10.74712,106.71013', '[{\"id\":\"size\",\"value\":\"28 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:22'),
