(5111, 96208892, 2147483647, 'Cho thuê nhà hẻm 2m Lê Lai Quận 1', 'Nhà số 96/14. Quý khách vui lòng xem bên ngoài nhà + hẻm nếu ok thì gọi điện xem nhà. Vì hẻm 2m và nhà trống nên để sẵn địa chỉ cho khách xem trước. \n\nNhà 1 trệt, 1 gác, 1 gác lửng. \nSàn suốt ko ngăn phòng.\nSàn lót gỗ, dán tường mới chưa ai ở.\nTrung tâm quận 1, đối diện trạm xe bus công viên 23/9.\nMiễn MG.', 1020, 96, 10000000, '0f6bf9b863cf6c897b1ec7363e2ded27-2778014911232933307.jpg', 1, '', '10.77007,106.69394', '[{\"id\":\"size\",\"value\":\"20 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:22'),
(5112, 91875691, 2147483647, 'PHÒNG ĐẸP FULL NỘI THẤT ĐIỆN BIÊN PHỦ, NGAY HUTECH', 'Phòng đẹp cho thuê đường Điện Biên Phủ - Phường 21 - Quận Bình Thạnh, đối diện đường Nguyễn Gia Trí (tên cũ: đường D2), gần ngã tư Hàng Xanh, ĐH HUTECH, ĐH GTVT, ĐH Ngoại thương, chỉ 5 phút đến trung tâm Quận 1.\nPhòng rất đẹp (hình thật 100%), các trang thiết bị tiện nghi:\n- Máy lạnh Panasonic.\n- Smart Tivi Samsung.\n- Bình siêu tốc, máy nước nóng Ferroli, thiết bị vệ sinh American Standard.\n- Giường king size, nệm Kymdan, tủ quần áo,…\n- Truyền hình cáp: miễn phí\n- Wifi: miễn phí\n- Chỗ để xe riêng biệt: miễn phí\nKhu vực nhiều tiện ích xung quanh: Trung tâm thương mại Pearl Plaza, Landmark 81, siêu thị Coop Mart, Vinmart, Circle K, rạp chiếu phim CGV, phòng tập gym California Fitness & Yoga, Starbucks coffee, Highland coffee, trà sữa Gong cha, KOI, The Alley, Khu du lịch Văn Thánh, công viên Vinhomes Central Park. \nGiá thuê 5 triệu.\nVui lòng liên lạc chính chủ theo số điện thoại bên dưới. Xin cảm ơn!', 1050, 109, 5000000, '8485e3c827ee526cdf594622e0eca43b-2777286381181583977.jpg', 0, 'Đường Điện Biên Phủ', '10.80123,106.71267', '[{\"id\":\"size\",\"value\":\"24 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:22'),
