(5117, 95405564, 2147483647, 'Phòng BanCông 3tr8 3tr3 ÂuCơ Lũy BánBích', 'Phòng Ban Công 3tr8 và 3tr3 gần Cây Xăng Âu Cơ Lũy Bán Bích\n\nChính chủ cho thuê, không chung chủ, giờ tự do, giao chìa khóa riêng\nPhòng trọ ngay mặt tiền đường, ngay mũi tàu Âu Cơ Lũy Bán Bích\nKhu vực an ninh, gần nhiều siêu thị.\nPhòng ban công, lầu 1, có sẵn nội thất giường nệm, tủ quần áo, máy lạnh, tủ lạnh, kệ bếp, toilet riêng biệt trong phòng\nNhà có máy giặt sử dụng chung, phơi đồ trên sân thượng.\nXe để tầng trệt trong nhà, cửa thẻ từ, giao chìa khóa riêng, giờ giấc tự do.\nNhà có hệ thống camera.\n\nGiá thuê: \nPhòng 3.800.000/tháng ( có ban công)\nPhòng 3.300.000/tháng (có cửa sổ)\nĐiện = 3.800đ/kW\nNước = 100.000/người/tháng\nGiặt Sấy = 100.000/người/tháng\nWifi = 50.000/tháng\n\nLiên hệ địa chỉ: 47 Nguyễn Thái Học, gần đoạn đầu mũi tàu cây xăng Âu Cơ Lũy Bán Bích\nĐiện thoại: Các bạn vui lòng gọi trước khi đến 30 phút nhé:', 1050, 112, 3300000, '0149b14d4f0b0d42b8da2689ffb126d6-2777228247895433030.jpg', 0, '', '10.794704,106.640526', '[{\"id\":\"size\",\"value\":\"20 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:23'),
(5118, 92851717, 2147483647, 'THUÊ CĂN HỘ BCONS GREEN VIEW 2PN-2WC 4TRIỆU', 'Vị trí: Mặt tiền Quốc Lộ 1K, nối dài Phạm Văn Đồng, Thủ Đức, phường Đông Hòa, Dĩ An. Ngay BigC Dĩ An, bệnh viện Hoàn Mỹ.\n\nKết cấu: 55m2, gồm 2 phòng ngủ, 2 toilet. Đa dạng lầu, đa dạng view.\nGiá chỉ 4triệu \n\nNgay sát làng đại học, đi làng đại học chỉ 3 phút.\nĐi sân bay Tân Sơn Nhất chỉ 20p, đi ngã tư Thủ Đức chỉ 15p, 30 phút tới quận 1.', 1010, 11, 4000000, '40d277961f50db7a52b4162bad4bee64-2763056453735661684.jpg', 2, '', '', '[{\"id\":\"size\",\"value\":\"55 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:24'),
