(5120, 95067919, 2147483647, 'CHO THUÊ CH PRECIA NHÀ MỚI 100% FULL NT 8TR', '- Tiện ích ngoại khu: Gần siêu thị Metro, BigC, Parkson, rạp chiếu phim, nhà hàng, chợ, trường học.\n- Tiện ích dự án D\'Lusso.\nHồ bơi lớn, hồ bơi em bé, sân chơi nước dành cho bé. Poolbar, hồ jacuzzi, gym. Công viên ven sông 1400m2. View thoáng mát, môi trường không gian xanh trong lành yên tĩnh, an ninh 24/24 có camera, nhiều tiện ích được miễn phí.', 1010, 97, 8000000, '3d2c74b875c34aa68a66cd5a975c5fbf-2772904874201102287.jpg', 2, '', '10.798573,106.75696', '[{\"id\":\"size\",\"value\":\"68 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:24'),
