(5131, 96208751, 2147483647, 'Cho thuê nhà nguyên căn tại quận Đống Đa', '?CÓ THỂ LÀM VĂN PHÒNG/HỘ GIA ĐÌNH\n?Nhà riêng Ngõ 171 đặng tiến đông \n?Diện tích: 45m2. \nMặt tiền 4m, nhà mới sơn sửa sạch đẹp thoáng mát \n?Xây dựng 4 tầng _mặt tiền 4m bao gồm: \n+ Tầng 1: phòng khách + bếp + vệ sinh \n+ Tầng 2_4: Phòng ngủ, nhà vệ sinh, sân phơi\n?Nhà đầy đủ điều hòa, nóng lạnh.\n?Xung quanh có nhiều tiện ích: Gần Hồ Hoàng Cầu, chợ Thái Hà, siêu thị, bệnh viện, trường học, công viên,... \n?Khu dân cư an ninh, dân trí cao.\n?Nhà có lộc kinh doanh buôn bán ( chính chủ từng kinh doanh online ra rất nhiều đơn) \n\n-Giá cho thuê: 18tr/ tháng _cọc 1 đóng 3_6 tháng/lần_thuê lâu dài', 1020, 75, 18000000, '14d65d09203ee6c8a2eb3cd4e77b2d8d-2778013979137826097.jpg', 3, '', '21.011003,105.8219', '[{\"id\":\"size\",\"value\":\"45 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"3 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:26'),
(5132, 94763322, 2147483647, 'KTX Ở GHÉP CAO CẤP TRUNG TÂM BÌNH THẠNH GIÁ SV', 'KTX Ở GHÉP ĐẦY ĐỦ TIỆN NGHI - GIỜ GIẤC TỰ DO - HỖ TRỢ GIẢM 500K TRONG 3 THÁNG ĐẦU – HĐ CHỈ 6 THÁNG \nGiờ giấc tự do - Trang bị giường tầng cao cấp : Có đèn, bàn học, rèm giường, nệm , gối mền... \n- Tủ quần áo.\n- Máy lạnh.\n- Tủ lạnh.\n- Kệ bếp + bếp từ.\n- Nước uống.\n- Phòng gym hiện đại.\n- Máy giặt.\n- Internet 200 Mb.\n- Phòng sinh hoạt, đọc sách hiện đại.\n- thang máy.\n- Máy giặt sử dụng MIỄN PHÍ. \n- Sân thượng phơi đồ rộng rãi. \n- Có camera an ninh, bảo vệ 24/24. \n- Có người dọn vệ sinh MIỄN PHÍ \n- Nhà vệ sinh với thiết bị cao cấp (vòi sen, lavabo,...), nước nóng lạnh. \n- Giờ giấc tự do, thoải mái. Phù hợp với người đi làm và sinh viên muốn TIẾT KIỆM CHI PHÍ sinh hoạt.\n?? Quyền lợi khi gia nhập Trusthome\n??♀️ Học tiếng anh giao tiếp free\n??♀️ rèn luyện sức khoẻ trong phòng gym\nhiện đại free\n??♀️ Đá bóng 2 lần/tuần\n??♀️ Được hỗ trợ làm sổ tạm trú dài hạn\ntương đương sổ KT3\n⛔️⛔️ Yêu Cầu Chung:\n? Nam/nữ tuổi từ 18-28 sống hoà đồng, giúp đỡ lẫn nhau, ý thức tự giác\n- Có thông tin về bản thân rõ ràng (CMND, thẻ sinh viên, giấy xác nhận nơi làm việc)\n??1 500.000vnd ( không phát sinh )\n⁉️ Địa chỉ: 105/3 bình quới, phường 27, quận bình thạnh', 1050, 109, 1500000, '4ca7abcf2c643b5d33df92832454772f-2771424340610810783.jpg', 0, '', '10.81712,106.72069', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:26'),
