(5147, 95997441, 2147483647, 'CHO THUÊ TÒA NHÀ NGANG 10M MẶT TIỀN VÕ VĂN KIỆT', 'CHO THUÊ TÒA NHÀ NGANG 10M, 800M2 MẶT TIỀN ĐƯỜNG VÕ VĂN KIỆT, ĐOẠN GẦN LOTTE\n- Kết cấu: Một trệt một lầu.\n- Diện tích: trệt 10m x 60m (lầu 10m x 20m)\n- Giá: 80tr\n- Lộ giới: 60m.\n- Hướng: Đông Bắc\n- Vị trí: nhà gần ngã tư Nguyễn Văn Cừ và Mậu Thân, đường nhộn nhịp mua bán và nhiều dân cư\n- Tuyến đường đẹp nhất của thành phố Cần Thơ lộ giới vỉa hè rộng rãi, nhà nằm mặt tiền trước Võ Văn Kiệt phía sau mặt tiền mậu thân nối dài. Nhà xây mới 100%, cách sân bay Cần Thơ 6km, ngay trung tâm Cần Thơ, xung quanh kinh doanh đông đúc sầm uất.', 1030, 27, 80000000, 'fb86612e4445b11666749b531cca1ad7-2777093639736040405.jpg', 0, '', '10.04551,105.75982', '[{\"id\":\"size\",\"value\":\"600 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:30'),
