(5149, 93122014, 2147483647, 'OPAL BOULEVARD 2PN 5TRIỆU', 'Vị trí: Ngay mặt tiền Phạm Văn Đồng,\n\nOpal Boulevard 2PN - 2WC.\nThông tin mô tả.\n- Diện tích sử dụng 75m2.\n- 2PN - 2WC.\n- Giá 5triệu\n\nHồ bơi vô cực, sân vườn trên cao, phòng tập gym & yoga trên cao, khu leo núi trẻ em, khu giải trí, vườn tri thức tất cả tạo nên một phong cách sống hoàn mỹ, đủ đầy và tiện nghi cho cả gia đình.\n\nTọa lạc trên trục đại lộ Phạm Văn Đồng, Opal Boulevard có vị trí giao thương chiến lược, nằm giữa Tp. HCM, Đồng Nai, Bình Dương, mang lại lợi thế kết nối độc đáo mà không dự án nào sánh được.', 1010, 11, 5000000, '55e48cea6c82a843b561c2f058740bfc-2764190883278041157.jpg', 2, '18 Kha Vạn Cân, phường An Bình, thị xã Dĩ An, Bình Dương', '10.86765,106.76222', '[{\"id\":\"size\",\"value\":\"86 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:30'),
(5150, 96072799, 2147483647, 'Cho thuê căn hộ I-Home1 Gò Vấp', 'CHO THUÊ CĂN HỘ I-HOME 1 TẦNG 6, QUẬN GÒ VẤP - Diện tích: 70m2. - Kết cấu: 2 phòng ngủ và 2 phòng tắm. - Căn hộ có cửa sổ lớn, rộng rãi view thoáng mát. - Thiết kế hiện đại, bàn giao nội thất đầy đủ. Với không gian không quá lớn nhưng vẫn đầy đủ tiện nghi, thiết kế hiện đại, cùng hàng loạt tiện ích đẳng cấp, giá thành hợp lý, căn hộ sẽ là lựa chọn lý tưởng cho nhiều nhóm khách hàng chọn để sinh sống như các khách hàng độc thân, yêu thích sự tự do hay các cặp vợ chồng trẻ mong muốn có một không gian sinh hoạt riêng tư, ấm cúng.  Tọa lạc tại trung tâm hành chính quận Gò Vấp, TP.HCM, Khu căn hộ I-Home nằm trong khu dân cư hiện hữu với hệ thống giao thông thuận lợi và kết nối nhanh chóng đến: Trung tâm văn hóa thể dục thể thao Gò Vấp, siêu thị Big C, trường Đại học Hồng Bàng.', 1010, 110, 12000000, '9bf9b076c44e36ecca6d732dce6207d0-2777396902331638338.jpg', 2, '', '10.850827,106.653824', '[{\"id\":\"size\",\"value\":\"70 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:30'),
(5151, 95965667, 2147483647, 'Cho thuê nhà Nguyên Căn hẻm xe hơi-Lê Đức Thọ-Gò', 'CHO THUÊ NHÀ PHỐ ĐƯỜNG LÊ ĐỨC THỌ, QUẬN GÒ VẤP - Diện tích đất: 80m2 (4m x 20m). - Diện tích sử dụng: 250m2. - Kết cấu nhà 1 trệt, 4 lầu có 6 phòng tắm và 4 phòng ngủ. - Nhà hướng tốt không lỗi phong thủy, đường rộng và thông thoáng. Sổ hồng riêng, pháp lý đầy đủ, bàn giao không có nội thất.  Nhà phố nằm trong khu dân cư đông đúc sầm uất cách đường Thống Nhất vài trăm mét, chỉ cách QL 1A khoảng 1,5km, xung quanh là đầy đủ các tiện ích, cơ sở hành chính, siêu thị, chợ truyền thống,... Đáp ứng mọi nhu cầu cho quý gia chủ đang mong muốn tìm 1 chốn an cư lâu dài giữa lòng thành phố nhộn nhịp.', 1020, 110, 19000000, '1bbe561564f2fad2ece09cf0a8f6b844-2776953229620135074.jpg', 0, '', '10.8528,106.670715', '[{\"id\":\"size\",\"value\":\"80 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"6 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:30'),
