(5153, 96208645, 2147483647, 'Phòng full nội cao cấp khu K300 giá rẻ', 'Phòng full nội thất, khu K300, gần trung tâm, gần chợ và bách hóa xanh, qua etown 5p đi bộ.... Cách công viên nhỏ 3p đi bộ\nTrong Khu vực cao cấp, đường thông thoáng, an ninh\nTiện ích đi kèm\nCó gara xe miễn phí\nCó sân thượng phơi đồ\nCó toilet riêng\nGiờ giấc tự do', 1050, 112, 3700000, '6d9e994ffd933230194dfcc6baa9ddf3-2778012578348662203.jpg', 0, 'Đường Mai Lão Bạng', '10.80596,106.64471', '[{\"id\":\"size\",\"value\":\"20 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:31'),
