(5155, 95977112, 2147483647, 'Cho thuê nhà nguyên căn- Lê Văn Chí,Thủ Đức', 'Cho Thuê nhà nguyên căn, diện tích sàn 100m2, 3 phòng ngủ, 1 nhà vệ sinh, 1 phòng bếp, 1 phòng khách, sân để xe. Hẻm 109 Lê Văn Chí, Linh Trung, Thủ Đức thoáng mát, sạch sẽ, an ninh, phù hợp cho gia đình, sinh viên, nhân viên văn phòng,...\nGiá 7.000.000đ/tháng\nLiên Hệ: Ms Thư-***\nHẻm 109 Lê Văn Chí, P. Linh Trung, Thủ Đức, HCM', 1020, 119, 7000000, 'af6a7aa9d3b3e641cb3254046c2fb2a2-2776997917049082237.jpg', 0, '', '10.85861,106.77763', '[{\"id\":\"size\",\"value\":\"75 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"3 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:31'),
(5156, 95797832, 2147483647, 'Cuối tháng trống 1 phòng - Trường Chinh, Tân Bình', 'Địa chỉ: 449 Trường Chinh, P. 13, Tân Bình\n- Phòng hiện đại, sạch sẽ\n- Nội thất: tủ lạnh, máy lạnh, bếp từ, nệm, máy nước nóng lạnh, kệ bếp\n- Phòng có cửa sổ bao thoáng mát\n- Giờ giấc tự do 24/24, không chung chủ\n- Giữ xe miễn phí 100%\n- Khu vực sống văn minh, an ninh\n- Tiện ích: gần Etown Cộng Hòa, BigC Trường Chinh, Co.op Thắng Lợi chỉ 5 phút đi xe, ...\n- Thuận tiện di chuyển: Tân Phú, Bình Tân, Q. 3, Q. 12, Gò Vấp, ...', 1050, 112, 3700000, 'b063cbdea040c8ec701e4b13ca521807-2776208550458306896.jpg', 0, '', '10.80281,106.6361', '[{\"id\":\"size\",\"value\":\"18 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:32'),
(5157, 96208623, 2147483647, 'Cho thuê phòng trọ sạch sẽ mát mẻ an ninh', 'Mình cần cho thuê phòng trọ\nKhu vực an ninh\nPhòng lót gạch lên tường nên bao mát mẻ, buổi trưa không nóng\nNgay mặt tiền đường kinh dương vương, gần siêu thị aeon, bến xe miền tây và bệnh viện Triều An\nChỗ để xe miễn phí, có camera, có sân phơi đồ\nCó phòng máy lạnh\nPhòng thích hợp ở từ 1 đến 2 người\nĐiện nước internet đầy đủ\nLiên hệ chính chủ', 1050, 108, 1300000, '3163cbbfc42392fd07ee16503572ada3-2778012700785471309.jpg', 0, '', '10.73437,106.6129', '[{\"id\":\"size\",\"value\":\"15 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:32'),
(5158, 96208619, 2147483647, 'Phòng trọ 28m2 ngay ngã tư hàng xanh Điện Biên Phủ', 'Cho thuê phòng trọ mới xây đầy đủ tiện nghi ngay ngã tư Điện Biên Phủ\nKhu vực: Cho thuê phòng trọ tại Đường Điện Biên Phủ - Quận Bình Thạnh - Hồ Chí Minh Giá: 4,6 triệu/tháng  Diện tích: 28m²\n \nThông tin mô tả\nCăn hộ mini đầy đủ tiện nghi, giờ giấc tự do không chung chủ ngay ngã tư Hàng Xanh Điện Biên Phủ, quận Bình Thạnh.\n\n- 1. Phòng đầy đủ tiện nghi mới xây, thoáng mát, yên tĩnh, an ninh, giờ giấc tự do, giếng trời thoáng mát: WC riêng, máy lạnh,giường,tủ bếp ,tủ quần áo, máy nước nóng năng lượng mặt trời, máy giặt (free), wifi.\n- 2. Ngay gần quận 1, gần bờ kè, gần cầu Thị Nghè, gần ĐH Ngoại Thương, ĐH Hutech, ĐH Văn Lang, ĐH Kinh Tế Tài Chính, ngay sát ĐH Hutech, ngay cầu vượt Điện Biên Phủ, gần Saigonland, cách chợ Văn Thánh 200m. Nhà cho thuê mới đẹp, có nội thất tiện nghi, phù hợp cho gia đình ở, văn phòng công ty.\nphòng rộng 28m2, sạch sẽ, được trang bị tiện nghi, các thiết bị hiện đại, tiết kiệm điện nước tối đa, đồng hồ riêng biệt.\n\n- Tiện nghi:\nNhà mới đẹp, rộng rãi thoáng mát phù hợp cho mở văn phòng, công ty kết hợp với ở.\nHẻm cụt yên tĩnh, hẻm rộng 5m.\nChỗ để xe rộng rãi.\nHệ thống camera giám sát an ninh, bảo vệ 24/24.\nMôi trường sống hiện đại - văn minh lịch sự.\nGiá thuê: 4,6 triệu/tháng.\nNước: 100.000/người, internet: 100.000/phòng.\n\nĐịa chỉ: Hẻm 441 Điện Biên Phủ, P25, quận Bình Thạnh.\nLiên hệ: Long *** để được tư vấn.', 1050, 109, 4600000, 'd0092c4ae1410a7a7962d26288695983-2778012429248560571.jpg', 0, '', '10.80408,106.71333', '[{\"id\":\"size\",\"value\":\"28 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:32'),
(5159, 95287987, 2147483647, 'CHDV 45 m2 đường Huỳnh Tấn Phát', 'CHDV Full nội thất địa chỉ 1157 đường Huỳnh Tấn Phát - ngay gần Phú Mỹ Hưng\n\nPhòng rộng từ 40-50 m2 có cửa sổ, ban công thoáng mát, sân riêng, khu vực BBQ, WC riêng từng phòng. Đặc biệt có buồng tắm  và chỗ tắm đứng trong phòng. Giá chỉ từ 4.500.000\n\nPhòng có Trang bị giường, tủ quần áo, tủ lạnh, máy lạnh, kệ bếp, máy nước nóng, bồn tắm…\n\nWifi, máy giặt, chỗ để xe, sân phơi rộng rãi, thoáng mát\n\nVị trí:  Ngay gần Phú Mỹ Hưng, Đại học tài chính Marketing, đại học Tôn Đức Thắng\nDễ dàng di chuyển đi Phú Mỹ Hưng, Quận 4, quận 1\nNhà yên tĩnh, mát mẻ, chỗ để xe rộng\nGIỜ GIẤC TỰ DO KHÔNG CHUNG CHỦ\nLiên hệ: Linh (call/zalo)', 1050, 102, 4500000, '59df19f672d9bf8f282cde9d3499f2a8-2777689830680565856.jpg', 0, 'Đường Huỳnh Tấn Phát', '10.72701,106.73342', '[{\"id\":\"size\",\"value\":\"45 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:32'),
(5160, 96205184, 2147483647, 'Cho thue phòng trọ 62/14', 'Hiện tại chỗ trọ của cô đang trống 1 phòng 25m2 ở tầng 3 giá 2tr8. Có các tiện ích như sau:\n- Lối đi riêng biệt không chung chủ nên tự do, thoải mái.\n- Nhà trong hẻm rộng, thoáng mát, không ngập nước, yên tĩnh, an ninh.\n- Có sẵn bếp, bồn rửa chén, toilet trong phòng\n- Chỗ để xe rộng rãi, sạch sẽ. Có người vệ sinh lối đi chung, nhà xe, cầu thang 1 tuần/lần.\n- Các phòng xung quanh thân thiện, lịch sự, hầu hết là người đã đi làm.\n- Điện 3k/ ký, nước 20k/khối, rác 10k/ phòng, internet free.\nBạn nào có nhu cầu thì liên hệ CÔ TRANG : *** để xem phòng nhé. \nPhòng sạch sẽ, ốp gạch y như hình nhé.', 1050, 102, 2800000, '1d68ca986c96b7fd26e126821f2da16e-2777994306163771896.jpg', 0, '', '10.7487,106.71418', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:32'),
(5161, 96114120, 2147483647, 'Nhà trệt lửng 75m2; 3.5×12 gần chợ chốt lẹ', 'Nhà y hình cho thuê lâu dài ổn đinh\n\nThích hợp bán online. May gc nhỏ. Gia đình ở.....\n\nKv tiện ích xung quanh đầy đủ sát chợ. Trường học các cấp....\n\nNhanh mới kịp khách ơi', 1020, 107, 3500000, '7aec85191c4338efe3d43295fbd62612-2777576522214200283.jpg', 1, '', '10.8683,106.62596', '[{\"id\":\"size\",\"value\":\"42 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:32'),
(5162, 93704034, 2147483647, 'CHO THUÊ CH ST MORITZ 2PN CHỈ 9TR', 'ST MORIT \n2PN-2WC CHỈ 9TR\n3PN-2WC CHỈ 13TR\n\nBàn giao hoàn thiện (Kohler, Hafele).\nLý do St Moritz hấp dẫn nhà Đầu tư, cư dân:\n- Vị trí đắc địa: cận thị, nhị cận giang, tam cận lộ.\n- Phong cách thiết kế chủ đạo của dự án hướng về thiên nhiên và đón ánh sáng mặt trời. Ấn tượng thiết kế \"Ban công kép\" sang trọng, đẳng cấp.\n- Tiện ích tầng thượng độc quyền 103 cư dân: Hồ bơi tràn, view sông, gym, BBQ, sân golf, khu vui chơi trẻ em. Ngoài ra, còn có tiện ích 4 căn TMDV và Nhà trẻ ở tầng trệt.\n- Hai Sảnh đón cư dân và sảnh đón văn phòng riêng biệt, chuẩn khách sạn 5 sao.', 1010, 119, 9000000, '14a012e3d09f6e4afe2d45a932a68526-2766769238736577581.jpg', 2, '', '10.835219,106.72527', '[{\"id\":\"size\",\"value\":\"75 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:33'),
(5163, 96208590, 2147483647, 'Cho thuê MB bán ăn sáng đối diện May Phong Phú', 'Cho thuê MB bán đồ ăn sáng đối diện công ty May Phong Phú, Golden Hill đông công nhân đi lại đông đúc thích hợp bán các đồ ăn sáng mang đi hoặc ăn tại quán như Bánh cuốn nóng, bánh mì, xôi gà, canh bún…., mặt tiền đường Tăng Nhơn Phú, số 213 cafe Tâm Minh\nGiá thuê: 1.500.000vnđ\nQuán nằm cạnh karaoke, và quán BBQ, mặt bằng rộng rãi\n(Vui lòng gọi điện thoại nhé vì mình ít khi coi tin nhắn)', 1030, 119, 1500000, '1860e3ab4336a48649a0e77a88f29b07-2778011497163459064.jpg', 0, '', '10.82902,106.77301', '[{\"id\":\"size\",\"value\":\"126 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:33'),
(5164, 92856661, 2147483647, 'cho thuê Nhà trong ngõ  10 nguyễn khắc cần Hk', 'Cho thuê nhà trong ngõ 10 Nguyễn Khắc Cần .quận hoàn kiếm .có diện tích sử dụng 52 m2  tầng 1 cách đường 10 m .Thông tin mô tả: \n+ Diện tích sử dụng 50 m2  , tầng1 + gác xép + bếp , mặt tiền 4,5 m\n\n+ Vị trí siêu đẹp  , miếng đất hiếm trên thị trường ,tiện  ở và thuê kinh doanh online đông khách . Điện nước đủ \n\n+ hướng đông nam\n\n+ Phía trước không bị chắn cây , cột điện , nhìn thẳng ra phố , đẹp\n\n+ Khu phố kinh doanh sầm uất , đảm bảo an ninh\n\n+ Giá: 3  triệu \n\n+ Liên hệ: Ms.miễn quảng cáo hoặc môi giới làm phiền.', 1020, 73, 3000000, '325328ffc2a4e54018e151bf67c5d491-2763075762935119990.jpg', 0, '', '21.035095,105.84737', '[{\"id\":\"size\",\"value\":\"50 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:33'),
(5165, 96208588, 2147483647, 'Nhà Phan Huy Ích (6x11) 3PN.3WC nội thất', '?Giá 14tr?\n?Cho thuê biệt thự mini tuyệt đẹp đường Phan Huy Ích Phường 12 Gò Vấp ?\nGiá Cho Thuê nhà: 14 triệu / 1 tháng :cọc 2 tháng. \nCho thuê hợp đồng dài hạn.cuối tháng nhận nhà.\n?Diện tích: 6 X 11\nCấu trúc: đúc 1 trệt 2 lầu, sân thượng. Kiến trúc hiện đại phong cách Châu Âu Tân cổ điển rất ấn tượng, nội thất cực kỳ cao cấp sang trọng. \nNhà vị trí cực VIP hẻm nhựa xe hơi 7 chỗ tới nhà khu phân lô cao tầng đồng bộ, cách MT Phan Huy Ích 100m hẻm rất yên tĩnh. Thiết kế gồm P. Khách rộng, P. Bếp, 3 Phòng ngủ, P. Thờ, P. Phơi đồ và Sân thượng rộng thêng thang', 1020, 110, 14000000, '2312f9ecb59e4061e0b7a068290211ba-2778011757391615780.jpg', 3, '', '10.83867,106.63845', '[{\"id\":\"size\",\"value\":\"66 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"3 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:33'),
(5166, 92821432, 2147483647, 'CHCC The Sun Avenue cho thuê căn 3PN full nt', 'Căn hộ chung cư The Sun Avenue\nVị trí: 28 Mai Chí Thọ, P. An Phú, Q2, giao thông thuận lợi, ít kẹt xe, di chuyển qua các quận 1,3, Thủ Đức, quận 9 nhanh chóng chỉ mất 10-15 phút đi xe\n\nDiện tích: 90m2, 3PN, 2 WC\n\nNhà được trang bị đầy đủ nội thất cao cấp, nhà mới 100%\n\nGiá thuê: 19tr/tháng ( bao phí quản lý)\n\nTiện ích đầy đủ, gym, hồ bơi, BBQ ( miễn phí)\nĐể biết thêm thông tin và xem nhà thực tế liên hệ em ngay\nCảm ơn đã đọc tin', 1010, 119, 19000000, '0b9fb41fb9a5e7a4ecdd7cf321de55c0-2778011785930250020.jpg', 2, '', '10.794479,106.751785', '[{\"id\":\"size\",\"value\":\"90 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"3 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:34'),
