(5172, 88341180, 2147483647, 'CHUYÊN CHO THUÊ CĂN HỘ RIVER PANORAMA Q7 2PN-3PN', 'Chuyên Cho Thuê Căn Hộ River Panorama 89 Hoàng Quốc Việt, Quận 7, 2PN,3PN Giá Tốt  Chỉ Từ 7.5 triệu/tháng\n\nThông tin mô tả:\n\nQuản lý 100% căn hộ River Panorama đang cho thuê, bao gồm NTCB và Full NT:\n\n*Căn hộ 2PN 1WC (56m2): Nhà trống từ 7.5 - 8 triệu/tháng, full nội thất 10-11 triệu\n\n*Căn hộ 2PN 2WC (65m2): Nhà trống từ  8.5 - 9 triệu/tháng, full nội thất 11-13 triệu\n\n*Căn hộ 3PN 2WC (90m2): Nhà trống từ 11 - 12 triệu/tháng, full nội thất 13-16 triệu\n\n*Căn hộ 3PN 2WC (113m2): Nhà trống từ 11-13 triệu/tháng, full nội thất 14-18 triệu\n\n- Nội thất cơ bản cao cấp: Máy lạnh, máy nước nóng, cửa gỗ chống cháy, trần thạch cao - hệ số chiếu sáng, vòi sen âm tường, tủ bếp trên dưới bếp, nhà vệ sinh, sàn gỗ, máy hút mùi....\n\n- Được miễn phí tất cả tiện ích như hồ bơi vô cực tầng thượng đỉnh, phòng xông hơi, tiệc BBQ ngoài trời trên tầng thượng đỉnh và tất cả các loại tiện ích nội khu.\n\n- Điện, nước, cáp nét: Theo hóa đơn nhà nước.\n\nRiver Panorama mang đến cho cư dân một cuộc sống đẳng cấp chuẩn 5 sao, với các tiện ích ngay trong nội khu như: Sảnh đón Resort, hồ bơi tầng thượng sang chảnh rộng đẹp, Aqua gym, khu chăm sóc trẻ em, khu giặt ủi, sân thể thao đa năng Elip, công viên biển sông, khu vui chơi trẻ em, trung tâm thương mại, cửa hàng tiện ích.\n\nLH Mr.Huy để được xem căn hộ thực tế miễn phí 24/7', 1010, 102, 7500000, '2391a0ac358283fc876a663bc8121645-2740032522421581321.jpg', 2, 'Đường Hoàng Quốc Việt', '10.71422,106.73743', '[{\"id\":\"size\",\"value\":\"56 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:34'),
