(5174, 96208535, 2147483647, 'Nhượng hợp đồng còn 3 tháng Bùi Viện Quận 1', 'Do mình có công việc ở xa nên phải dời đi gần cho chổ làm. Cần nhượng lại hợp đồng thuê nhà còn 3 tháng tính từ lúc mình đăng tin này . Rất thuận tiện cho các bạn muốn ở ngắn hạn. Nội thất đầy đủ(tủ lạnh, máy lạnh, máy nóng lạnh), phòng rộng thoáng 2 cửa sổ to ko giới hạn số người ở ghép. được nuôi pét, giờ giấc thoải mái không chung chủ, gửi xe ở ngoài. \nThang bộ Lầu 4\nTiền nhà 5tr .tiền cọc 5tr\nNước 100k/người\nđiện 4000\ntiền dịch vụ 200k ( wifi , máy giặc , rác , lau dọn vệ sinh phòng 1 lần/ 1 tuần ) \nLiên lạc trực tiếp sđt *** (duy)', 1050, 96, 5000000, '74b63d8b7872965362a08294906865ab-2778012470479777613.jpg', 0, '', '10.76683,106.69268', '[{\"id\":\"size\",\"value\":\"35 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:35'),
(5175, 96208511, 2147483647, 'CHO THUÊ NHÀ NGUYÊN CĂN MỸ ĐÌNH', 'CHO THUÊ NHÀ NGUYÊN CĂN MỸ ĐÌNH \nĐịa chỉ:  ngõ 394 Mỹ Đình gần Kangnam\nNhà mới koong chưa có người ở.\nDiện tích: 30m2\nThiết kế 5 tầng, hiện đại nhất xu hướng hiện nay.\nTầng 1: Phòng Khách + bếp.\nTầng 2: Phòng ngủ + WC\nTầng 3 : Phòng ngủ + WC\nTầng 4: Phòng ngủ + WC\nTầng 5: Phòng thờ + sân phơi\n— Nội Thất full đồ như ảnh và video \n- Nhà ưu tiên hộ gia đình và nhóm.. ( không  cho kinh doanh)\nBên ngoài ngõ quẹt thẻ từ mới được vào, đảm bảo an ninh. \n- Giá thuê 15tr ( có thương lượng )\n- TT 3-6 tháng cọc 1', 1020, 121, 15000000, '58b554a80618314287b7af1dd188b2ae-2778010048522160632.jpg', 3, '', '21.025736,105.77021', '[{\"id\":\"size\",\"value\":\"30 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"3 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:35'),
(5176, 93058888, 2147483647, 'Hifriendz hỗ trợ cọc cư xá ngân hàng Lâm Văn Bền', 'Hifriendz nhận giữ phòng giữa CUỐI tháng 6\n\nSản phẩm độc quyền bởi Hifriendz\n\nVị trí: Lâm Văn Bền cư xá ngân hàng Q7 - Gần trường đại học Tài Chính - Marketing UFM, Khu chế xuất Tân Thuận, ĐH Tôn Đức Thắng, ĐH Rmit, ĐH Nguyễn Tất Thành, ĐH Luật, Phú Mỹ Hưng….\n\nNhà mới xây đẹp tinh khôi - Tất cả các căn đều có Bancon, cửa sổ thoáng \n\nĐẶC BIỆT: Nhà mới 100% bạn là người Bóc Tem\n\nHifriendz - Hỗ Trợ cọc \n\n\nNơi để xe rộng rãi \nGiờ giấc tự do, cuộc sống không chung chủ\nBạn bè, người thân đến chơi thoải mái\n\n\nDuplex: 4.5-5.5\nTủ lạnh + 200K\n\n!!!!!! LH Xem phòng và được hỗ trợ cọc', 1010, 102, 4500000, 'e4ad950b52986f7222c0c2b4eafe1235-2770873019681385327.jpg', 1, '', '10.74351,106.7285', '[{\"id\":\"size\",\"value\":\"35 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:35'),
(5177, 95832474, 2147483647, 'Cho Thuê  Precia Quận 2. 3PN bao phí QL 14 triệu.', 'Nội thất cơ bản: Tủ bếp trên, bếp dưới, Full Tollet, full máy lạnh, full máy nước nóng (lắp thêm rèm).\nCăn 3PN- 2WC DT 97m2  cần cho thuê 14 triệu bao phí quản lý.\n\n- Tiện ích ngoại khu: Gần siêu thị Metro, BigC, Parkson, rạp chiếu phim, nhà hàng, chợ, trường học.\n- Tiện ích dự án Precia.\nHồ bơi lớn, hồ bơi em bé, sân chơi nước dành cho bé. Poolbar, Hồ zacuzi, gym. Công viên ven sông 1400m2. View thoáng mát, môi trường không gian xanh trong lành yên tĩnh, an ninh 24/24 có camera, nhiều tiện ích được miễn phí.\nLiên Hệ Thảo xem nhà.', 1010, 119, 14000000, '06681a6047be6d30583afbf883ba68d4-2776353878902941520.jpg', 2, '', '10.77618,106.69653', '[{\"id\":\"size\",\"value\":\"97 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"3 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:36'),
(5178, 96208499, 2147483647, 'Nhà cho thuê vĩnh lộc A', 'Nhà cho thuê ấp 6, vĩnh lộc A Bình Chánh.diện tích 48 m2.có 2 phòng ngủ, gác lửng, gần chợ, trường tiểu học, trung học cơ sở, trung học phổ thông.gần các khu công nghiệp Tân Bình, vĩnh lộc, mỹ hạnh đức hòa.Cách sân bay Tân Sơn nhất 13 km.khu vực an ninh, hàng xóm thân thiện, giờ giấc tự do, điện nhà nước.ưu tiên  gia đình 3hoăc 4 người.miễn trung gian.', 1020, 115, 3000000, 'd6ad53c3924767e8432c8e507d21e302-2778012240694972121.jpg', 1, '', '10.81417,106.58135', '[{\"id\":\"size\",\"value\":\"48 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:36'),
(5179, 96208484, 2147483647, 'Nhượng lại hợp đồng Sunrise cityview 7.5tr/tháng', 'Cần pass lại phòng Officetel 38m2 Sunrise Cityview lầu 11, view hồ bơi và đường Nguyễn Hữu Thọ.\n\nDo có việc cần dọn về quê nên nhượng lại hợp đồng căn này cho bạn nào cần.\n\nPhòng không có nội thất. Chỉ có NTCB gồm máy lạnh, rèm cửa, tủ bếp trên dưới, máy nước nóng.\n\nGiá 7tr5/tháng (free phí quản lý) - Cọc 2 tháng\n\nLiên hệ mình qua tin nhắn, điện thoại hoặc Zalo', 1010, 102, 7500000, '048cdc2fef1f0414171a858d77d67990-2778011959630663854.jpg', 1, '', '10.7453575,106.70084', '[{\"id\":\"size\",\"value\":\"38 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:36'),
(5180, 96208481, 2147483647, 'Cho thuê nhà full nội thất', '?Cho thuê nhà Hồ Đắc Di, f tây thạnh, q tân phú\n?Dt 4,3×11 nhà 1 trệt 1 lầu có 2pn, 2wc\n?Full nội thất : 3 máy lạnh, tủ lạnh,máy giặt, tủ quần áo, giường, bàn làm việc , sofa....\n?Nhà đẹp như hình, hẻm 3m cụt an ninh,  cách hẻm xe tải chỉ 5m , nhà có 2 lớp cửa an toàn\n??Giá thuê 10tr/ tháng, hợp đồng 2 năm cũng không tăng giá \n?? Nhận nhà ngày 20/07/2022\nMTG VÀ ĐĂNG TIN QUẢNG CÁO', 1020, 113, 10000000, '23ca88a6edd78e1826291d1786751370-2778011954670864888.jpg', 2, '', '10.80581,106.63353', '[{\"id\":\"size\",\"value\":\"46 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:36');
