(5182, 96208462, 2147483647, 'Cho thuê nhà vườn', 'Nhà vườn rất yên tĩnh cho thuê trong ngõ 61 Phan Kế Bính, cạnh trung tâm Lotte và vườn thú / công viên Thủ Lệ (5 phút đi bộ) nên có không khí trong lành, an ninh tốt, giao thông thuận tiện; được thiết kế đẹp, thuận tiện, 4 tầng với tổng diện tích gần 125m2 bao gồm cả sân vườn.\nNhà xây 3 tầng ( mỗi tầng 60m2) và 1 tầng thượng gồm: \nTầng 1: 1 phòng khách, 1 phòng ăn và một nhà bếp và 1 WC có nước nóng, \nTầng 2: 2 phòng ngủ có máy lạnh 2 chiều, nhiều ánh sáng, nhiều cửa sổ và 2 ban công; WC có nước nóng.\nTầng 3: 2 phòng ngủ có máy lạnh 2 chiều, nhiều ánh sáng, nhiều cửa sổ và 2 ban công; WC có nước nóng.\nTầng thượng có sân rộng để tập thể dục, tiệc tùng ...\nNội thất đầy đủ, chỉ cần mang theo vali của bạn để ở (phù hợp cho gia đình, nhóm và văn phòng).', 1020, 74, 16500000, '1d57fdbe1b084f016146f098ff73c5c3-2778011556232924889.jpg', 3, '', '21.03641,105.80831', '[{\"id\":\"size\",\"value\":\"125 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"4 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:37'),
(5183, 96208458, 2147483647, 'Căn hộ 1 PN Bình Thạnh gần cầu Bình Lợi. Hàng xanh', '??CĂN HỘ 1 PHÒNG NGỦ BAN CÔNG CỰC XỊN NGAY BÌNH THẠNH - GẦN NGÃ TƯ HÀNG XANH ??\n\n?Địa chỉ: Nguyễn Xí, Bình Thạnh\n\n?ĐỂ ĐƯỢC OTO\n\n?1 Phòng ngủ cực rộng, ban công cực chill\n\n?Toà nhà thang máy, full nội thất xịn mịn\n\n☎️Nhanh liên hệ Trang để book phòng nhé\n\n??HỖ TRỢ CỌC', 1010, 109, 8500000, 'cee76781519148f0138da1b3014320e8-2778011984853797368.jpg', 1, '', '10.826654,106.70376', '[{\"id\":\"size\",\"value\":\"40 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:37'),
