(5201, 96139495, 2147483647, 'Căn hộ full NT, máy giặt riêng, Hình thật giá thật', 'CĂN HỘ CAO CẤP MINI CHO THUÊ QUẬN 7\n\n? Vị trí thuận tiện \nNằm trong hẻm an ninh đâm thẳng ra Nguyễn Văn Linh và Nguyễn Thị Thập\n- Qua q1, q4 và các trường ĐH UFM, ĐH luật, ĐH Nguyễn Tất Thành,....\n\n? Đầy đủ nội thất _ mới chưa một lần sử dụng\n- Máy lạnh, tủ lạnh, máy nước nóng lạnh;\n- Kệ bếp, tủ bếp, tủ đồ bàn làm việc.\n- - Vòi tắm hoa sen, gương tắm, lavabo, thanh treo đồ inox;\n\n? Căn hộ có cửa sổ đón sáng và gió tự nhiên\n\n? Dịch vụ miễn phí\n• Hệ thống PCCC\n• Camera an ninh 24/7\n• • Vệ sinh khu vực chung hàng tuần\n\nGIÁ:\n➖ Loại 1: 4tr5 - 5tr\n➖ Loại 2: 5tr5 - 6tr\n\nHợp đồng : 06 - 09 - 12 Tháng\n\n?? Nhanh tay nhấc máy bấm số gọi để được đặt lịch xem phòng ngay nha. Tặng ngay 02 vé xem phim khi book lịch xem phòng từ nay đến hết 31/06/2022', 1010, 102, 4500000, '39a0499c884e1f5fee9d0f3eead62ab3-2777709176742653421.jpg', 1, '', '10.75083,106.72357', '[{\"id\":\"size\",\"value\":\"37 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:41'),
(5202, 91922144, 2147483647, 'Cho thuê phòng đối diện Hutech Ung Văn Khiêm', 'Chung cư chính chủ cho thuê phòng ( miễn trung gian ) đối diện đại học hutech cơ sở Ung Văn Khiêm\n\nĐịa chỉ: \n	31/55 Ung Văn Khiêm F25 Q. Bình Thạnh Tphcm \n\n	Mặt tiền đường lớn 2 làn xe ô tô \n	Gần chợ , rạp chiếu phim , trung tâm mua sắm , cửa hàng tiện ích \n	Gần cầu sài gòn , D2 ( Nguyễn Gia Trí ) thuận tiện di chuyển đến trung tâm Q1 , Q3 và thành phố Thủ Đức\n	Đối diện đại học hutech Ung Văn Khiêm ( thuận lợi cho sinh viên hutech )\n	Trang thiết bị trong phòng cửa galaxy , thiết bị vệ sinh inax , cửa sổ cửa toilet nhôm xingfa cao cấp , bàn bếp đá hoa cương , phòng đẹp\n	Toà nhà mới xây, sach sẽ\n	Toà nhà có thang máy , có camera an ninh ( khu vực an ninh , yên tĩnh )\n	Hầm xe riêng chung cư rộng\n	Không nuôi thú nuôi ( chó , mèo …..)\n\n	Điện 5k/ KWH , nước 20.000 / m3 ( mỗi phòng có đồng hồ điện nước riêng ) , đổ rác 30.000 / phòng / tháng , giữ xe 150.000/ xe / tháng\n	Free wifi , thang máy , free máy giặt mỗi tầng\n\n	Phòng 2 - 3 người không máy lạnh 4 triệu / phòng / tháng , có máy lạnh 4,5 triệu / phòng / tháng \n\n	Phòng đôi ở tối đa 4 người gồm 2 phòng thông nhau ( 2 máy lạnh ) giá 7 triệu / phòng / tháng', 1050, 109, 4000000, '', 0, '31/55, Hẻm 31 Ung Văn Khiêm', '10.80999,106.71509', '[{\"id\":\"size\",\"value\":\"18 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:41'),
