(5205, 95760975, 2147483647, '5 Phòng Mới Có Gác Đường Phạm Ngũ Lão kế chợ GV', '5 Căn hộ có gác,toilet riêng, mới xây có gác cao 1.7m, có BAN CÔNG tại đường Phạm Ngũ Lão, P7 Q Gò Vấp, cách chợ gò vấp chỉ 5p\nChỉ từ 4.5 triệu/phòng/tháng các bạn đã tìm được căn hộ 25m2 với những tiện ích sau:\n1- Vị trí thuận tiện, đi bộ ra chợ Gò Vấp, đi ĐH Công Nghiệp trong 5p, đi q1, sân bay chỉ trong 3km\n2- Có Bãi xe riêng khu căn hộ bao chống ngập\n3- Phòng có gác, mỗi phòng 1 wifi riêng, hành lang thoáng mát-ánh sáng tự nhiên\n4- Camera an ninh\n5-Căn hộ riêng, KO chung chủ\n6-Đồng hồ điện nước wifi tốc đô cao riêng biệt cho từng căn hộ.\n7-Phòng giặt sấy\nVị trí: Hẻm 58 Phạm Ngũ Lão\nLiên Hệ Cô Thủy', 1050, 110, 4500000, '4eed050800656d4f3b25d15f181036a7-2776056419831048012.jpg', 0, '', '10.82545,106.68074', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:42'),
