(5213, 92227563, 2147483647, 'CĂN GÓC FULL NT OPAL BOULEVARD 3PN 8TR5', 'CÒN LẠI NHỮNG CĂN OPAL BOULEVARD 2PN 6TR \n- Diện tích: 85m2. 3PN 2WC.\n- Giá 8.5TR/TH\n\nKhi sở hữu căn hộ ở đây bạn sẽ nhận được rất nhiều tiện ích:\n\n- Có hồ bơi, công viên, spa để thư giãn mỗi ngày, phòng gym hiện đại...\n- Không khí trong lành, thoáng mát với nhiều cây xanh.\n- Khu dân cư dân trí cao, an ninh 24/24.', 1010, 11, 8500000, '28fc50d14916557a93bf1e5133ba2450-2760264752944646598.jpg', 2, '18 Kha Vạn Cân, phường An Bình, thị xã Dĩ An, Bình Dương', '10.86765,106.76222', '[{\"id\":\"size\",\"value\":\"85 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:44'),
