(5225, 94747055, 2147483647, 'Ibox Homestay- chỗ ở phong cách cho bạn trẻ', 'Ibox là loại sleepbox cao cấp nhất hiện nay, cung cấp chỗ ở cho bạn trẻ:\n\nSLEEP BOX ĐỦ NỘI THẤT \nBên trong mỗi box có đủ nội thất gồm: Tủ treo quần áo, kệ sách, bàn học, kệ trang điểm, gương soi, đèn và quạt cá nhân, 2 ổ cắm điện ở 2 đầu, hộc để giày, cửa khóa ngoài và chốt bên trong.\nKhi nhận box bạn sẽ được nhận nệm, bộ drap, mền và 5 cái mắc áo miễn phí. \n\nĐỦ MỌI TIỆN NGHI \nBox được đặt trong phòng máy lạnh, wifi free, toilet riêng từng phòng. Khu vực chung được trang bị: tủ lạnh, máy giặt, bếp từ, lò vi sóng, ấm siêu tốc, nồi cơm điện... Có chỗ phơi đồ và ủi đồ. Tất cả tiện nghi đã bao gồm trong giá thuê. \n\nAN NINH VÀ RIÊNG TƯ\nTừng box có cửa khóa và chìa khóa riêng để bảo đảm an ninh và một không gian riêng tư, nhỏ nhưng ấm cúng. Khóa vân tay bên ngoài.  Camera an ninh tại khu vực chung. \n\nCÓ 5 CHI NHÁNH\n?CN4: 33 đường số 6, TP. Thủ Đức, đối diện đại học Luật, giáp ranh Gò Vấp và Bình Thạnh (còn box)\n?CN1: 60 Nguyễn Trãi, p Bến Thành, Q 1 (sát ks New World)(full)\n?CN2: 342 Hoàng Hoa Thám, Gò Vấp,  giáp ranh Bình thạnh và Phú nhuận, cách có mấy bước chân(full)\n ?CN3: 549/91 Nguyễn Đình Chiểu, quận 3 (đầu hẻm 16 Nguyễn Thiện Thuật, giáp ranh quận 1, 5, 10). Sẽ bắt đầu nhận khách từ giữa tháng 5)\n?CN5: 99/20/7 Nguyễn Văn Linh, Tân Thuận Tây, Quận 7 (chân cầu Tân Thuận 2, giáp quận 4). Còn box. \n\nGiá trọn gói từ 1tr4 đến 1tr9, tùy theo chi nhánh. Giá đã bao gồm tất cả tiện nghi, không bao gồm gửi xe.', 1050, 102, 1500000, '9485a2b3625e508fe878a583d1521e94-2771487298213301889.jpg', 0, '', '10.750968,106.72161', '[{\"id\":\"size\",\"value\":\"32 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:47'),
