(5235, 94552239, 2147483647, 'Cần người tử tế Thuê kho xưởng tâm huyết như hình', 'Cần người tử tế thuê nhà kho xưởng như hình. Giá có thể thương lượng thêm.\n-Vị trí hẻm 2 sẹc đường Kênh Trung Ương thuộc Vĩnh lộc A, giáp ranh Vĩnh lộc B. Nhà cách đường KTU 120m. Hẻm đầu rộng 6 m. hẻm tiếp (hẻm trước nhà) rộng 4m cách hẻm đầu 25m. \n-Đặc điểm : Nhà xây đẹp, kiên cố, xây hết đất,  ốp gạch toàn bộ như hình, cả dưới và trên lầu, nên rất sạch sẽ. Nên cần người tử tế thuê và trông nom nhà cửa. Mái được chống nóng và chống ồn rất kỹ, nên rất mát mẻ. đến thích ngay. Xung quanh có nhiều căn biệt thự và nhà vườn, dân địa phương ở đông đúc, vui vẻ và tử tế, \n Nhà đã vào nước máy thủy cục rất mạnh và sạch sẽ\n  Nhà có điện 1 phase, nếu cần điện 3 phase có thể kiếu về. Ai có nhu cầu thì nhanh chân liên hệ, tôi sẽ gửi định vị vị chí chính xác. Cảm ơn đã xem tin!', 1020, 115, 8000000, '9983bde4e1fc76a7865829d8ddc5a03d-2770609324361937098.jpg', 2, '', '10.79659,106.55294', '[{\"id\":\"size\",\"value\":\"250 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"5 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:49'),
(5236, 89337895, 2147483647, 'Chung cư Conic Riverside 72m² 2PN', 'Cho Thuê Căn hộ Quận 8 (100% New)\nGiỏ Hàng những ngày đầu tháng 11/2021\n\n+ Căn Hộ 50m2 1 Phong ngủ + 1 phòng đa năng 4triệu 500 tới 6 triệu ( Tuỳ Nội Thất)\n\n+ Căn hộ 64m2 2 Phong ngủ  1wc giá 5tr5 - 6tr ( Tuỳ Nội Thất)\n\n+ Căn hộ 66m2 2 Phong ngủ  2wc giá 6tr - 6t5 ( Tuỳ Nội Thất)\n\nVới thiết kế hài hòa, ánh sáng vào nhà, rộng , thoáng, sạch đẹp là các thế mạnh của Conic Riverside,\nVới nội khu hồ bơi, cửa hàng tiện lợi, khuôn viên rộng bao quanh bời dòng sông thuộc nhánh của sống Cân Giuộc.\n\n+ phí quản lý 9k/m2/Tháng,\n\n+ giá gửi xe 80k/xe/tháng, \n\nCách quận 7 20p di chuyển, Quận 1 30p di chuyển,Bính chánh 5p di chuyển,Quận 5 20p di chuyển,Quận 6 20p di chuyển Có phòng Full nội thất, an ninh tự do, chủ nhà dễ thương, đôi bảo vệ nhiệt tình - Phù hợp với nhân viên văn phòng, sinh viên, cặp đôi mới cưới,gia đình có 3 4 thành viên, có em nhỏ khu quận 4, 7, 8, 5, 6, Bình Tân, Bình Chánh, Nhà Bè.', 1010, 103, 4500000, 'c8b80a370365dccabc1d575c7ad4e005-2745019105434938196.jpg', 2, 'đường Nguyễn Văn Linh', '10.73901,106.71798', '[{\"id\":\"size\",\"value\":\"72 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:49'),
(5237, 88808873, 2147483647, 'RICHMOND CHO THUÊ GIÁ CỰC RẺ 2PN - 10TR', '- 2PN, 2 WC, DT 66m2: Giá 10 triệu/tháng.\n\n- 2PN, 2WC, full nội thất mới đẹp: Giá 13 triệu/tháng.\n\n- 3 PN, 2WC, full nội thất mới đẹp: Giá 15.5 triệu/tháng.\nChung cư mới đẹp, cao cấp với rất nhiều tiện ích\nAn ninh, khu dân trí cao\nGần chợ, siêu thị, bệnh viện, TTTM,... và nhiều tiện ích ngoại khu khác', 1010, 109, 10000000, '56b89ee85febd9622d562c9c549b26a6-2762015811135336529.jpg', 2, 'Số 207 Đường Nguyễn Xí', '10.81646,106.7062', '[{\"id\":\"size\",\"value\":\"77 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:50'),
(5238, 83902282, 2147483647, 'Phòg Hồ Biểu Chánh Gần sân bay, không chung chủ', 'không chung chủ, Camera an ninh 24/24, bạn bè vui chơi thoải mái \n- Nhà trong khu biệt thự an ninh 24/24 đỡ cướp của giết người hơn so với ở khu lao động Tiện kinh doanh online \n-----Lý do Thuê: \n- Ra quận 1: 5 phút đi xe, Quận 5 2 phút, Quận 10 1 phút 30 giây. \n- Là trung tâm quận Phú Nhuận, dân cư tập trung đông đúc  : 2 phút ra chợ Trần Hữu Trang, 1 phút 30 giây Học viện hàng không, 10 phút ra sân bay Tân Sơn Nhất, 5 phút ra Đại Học Marketing và rất nhiều trường đại học khác.\nSố lượng phòng ít ( nên an ninh), các phòng diện tích lớn nhỏ khác nhau cũng như có toilet riêng chung khác nhau dễ chọn \n- 4 phút đến trường đại học Sư Phạm Thể Dục Thể Thao, Trường đại Học Quốc tế Hồng Bàng, kí túc xá đại học Sài Gòn, kí túc xá Đại học y Dược, trung Tâm giáo dục thường xuyên. \n----Phòng không có toilet riêng, phải dùng chung với 2 phòng khac khác 2.300.000đ \n----Phòng Toilet riêng khép kín giá: 2.800.000đ \n------Phòng ban công, cửa sổ, Wc riêng khép kín: 3.200.000đ \n- Giờ tự do 24/24 \n- Camera an ninh 24/24 \n- Hệ thống máy nước nóng lạnh năng lượng mặt trời \n- Không chung chủ, bạn bè đến chơi thoải mái. Ở chung chủ như nàng dâu ở với mẹ chồng, ở không nổi đâu. \n- Điện nước giá rất rẻ \n- --ưu tiên Vợ chồng, nữ thuê sẽ được giảm giá', 1050, 111, 2300000, '8080586fab1e9c18709f126cd2da308b-2711906137460374910.jpg', 0, 'Đường Hồ Biểu Chánh', '', '[{\"id\":\"size\",\"value\":\"20 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:50'),
