(5241, 96208064, 2147483647, 'cho thuê phòng trọ quận 3 Lý Chính Thắng', '✅Em cần tìm người ở chung  nhà ở lý chính thắng quận 3  có đầy đủ máy lạnh, nệm , quạt, tủ lạnh, nóng lạnh , nvs trong phòng( khép kín) có công tơ riêng sài nhiu tính nhiu\n? Phòng  có cửa sổ rèm cửa?\n❗Em còn dư 1 phòng lớn giá 5tr ( có thương lượng )  ❗️\n‼️ ưu tiên những bạn ở dễ thương đáng yêu cuteee ‼️\n♻Bếp chung , có tủ lạnh dưới bếp , có ban công rộng, mát có thể làm lẩu nướng\n❇Giờ giấc  tự do ƯU TIÊN NỮ ở do nhà toàn nữ, có thể nuôi thú cưng trừ chó do nhà nuôi mèo . Yêu cầu Sạch sẽ , hoà đồng , dễ thương\n✅Dịch vụ 120k / tháng ( gồm tiền rác, wifi, máy giặt , bếp )\n✅Giá điện từ 2k trở lên\n✅ Nước 50-100k/ người / tháng', 1050, 98, 5000000, 'ba332f467352e2acc9940cb53fcba61c-2778008373968898552.jpg', 0, '', '10.78477,106.68463', '[{\"id\":\"size\",\"value\":\"45 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:51'),
