(5243, 92136327, 2147483647, 'GIỎ HÀNG CĂN HỘ CHO THUÊ D\'LUSSO EMALRAD 2PN 8TR', 'D\'Lusso Emerald nằm ngay trung tâm Quận 2, chỉ cách nửa bước chân để đến khu đô thị mới Thủ Thiêm, hướng đi Cao tốc Long Thành - Dầu Giây, giáp ranh Quận 1, Quận 7, thừa hưởng tiện ích từ các dự án, trung tâm thương mại, văn phòng, trường học đẳng cấp quốc tế.\n GIỎ HÀNG CỤ THỂ: \n+ Căn hộ 1PN - 1WC: Diện tích 49.1m2. Hoàn thiện cơ bản có gắn máy lạnh và rèm 6tr/tháng. Full nội thất 8tr/tháng.\n+ Căn hộ 2PN - 1WC. Diện tích 55m2 hoàn thiện cơ bản có gắn máy lạnh và rèm 8tr/tháng. Full nội thất 8tr/tháng.\n+ Căn hộ 2PN - 2WC: Diện tích 68.5m2. Hoàn thiện cơ bản có gắn máy lạnh và rèm 8tr/tháng. Full nội thất 11tr/tháng.\n+ Căn hộ 2PN - 2WC. Diện tích 76m2 hoàn thiện cơ bản có gắn máy lạnh và rèm 10tr/tháng. Full nội thất 12tr/tháng.\n+ Căn hộ 2PN - 2WC. Diện tích 80m2 hoàn thiện cơ bản có gắn máy lạnh và rèm 11tr/tháng. Full nội thất 13tr/tháng.\n\nNội thất đi kèm bao gồm: Máy lạnh, máy nước nóng, cửa gỗ lõi thép chống cháy, kệ bếp trên dưới, chậu rửa, video call.\n\nLiên hệ số điện thoại 0706679*** để được hướng dẫn cụ thể.\nUy tín - Tận tâm - Chuyên nghiệp', 1010, 97, 8000000, '81359220b942f9b89d2303d0761adcda-2759845134283808623.jpg', 1, '150 Đường Nguyện Thị Định', '10.78806,106.7553', '[{\"id\":\"size\",\"value\":\"55 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:51');
