(5253, 96207972, 2147483647, 'Cần cho thuê nhà mặt tiền quận 12', 'Mình cần cho th.uê nhà mặt t.iền đường TA16 phường Thới An Quận 12 ,diện tích 5×13 ,1 trệt ,1 gác lửng ,1 nhà vệ sinh và bếp,sân trước rộng hơn 30m2.Phù hợp vừa ở ,vừa buôn bán kinh doanh.Tuyến đường TA16 này rất nhộn nhịp và đông đúc,phù hợp hầu hết với các ngành nghề kinh doanh buôn bán bình dân. \nGiá : 6tr / tháng ( sẽ hỗ trợ bớt còn 5tr/ tháng trong  tháng đầu cho người thuê kí hợp đồng từ 1 năm trở lên ).Hiện giờ đang cho thuê bán ốc bình dân,có thể giao nhà ngay từ 12/7.\nMiễn tiếp môi giới,báo chí ,quảng cáo.Có \"cafe\" cho người giới thiệu.\nLiên hệ chính chủ.', 1030, 107, 6000000, '32945565ccb0633366db66889b9efb73-2778008971152614624.jpg', 0, '', '10.87881,106.65147', '[{\"id\":\"size\",\"value\":\"60 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:53'),
(5254, 85696891, 2147483647, 'Phòng trọ một người ở Bình Thạnh sleepbox', '?Chi nhánh sleepbox vừa hoàn thành tại Bình Thạnh\n?Giá cực ưu đãi chỉ từ 1,5tr bao gồm tất cả chi phí \nHiện đại phòng mới ? \n?Máy lạnh, \n?Máy giặc\n?Nhà bếp đầy đủ dụng cụ nấu ăn cho mọi ngừoi \n?Wf, điện nước đều miễn phí \n?Ra vào bằng cửa khoá vân tay hiện đại\n?Camera an ninh 24/24 \n?Đến ngay và trải nghiệm \nCác chi nhánh khác \n⚡️16 Nguyễn Trung Trực p5 Quận Bình \n⚡️251/77 Lê Quang Định p7 Quận Bình Thạnh \n⚡️16 Huyền Quang phường Tân Định Quận 1', 1050, 109, 1500000, 'cf39bb3b9ebfddbe0179ff0a5165927b-2719458268997446932.jpg', 0, '251/77 Lê Quang Định', '10.80978,106.6927', '[{\"id\":\"size\",\"value\":\"2 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:53'),
(5255, 96207970, 2147483647, 'Phòng Mới Xây, Full Nội Thất, Thành Thái, Q10', '!!Đang trống phòng mới, full nội thất tại Thành Thái, Quận 10\n- Tọa lạc tại vị trí đắc địa tại trung tâm, đồng thời nằm trên tuyến đường huyết mạch, gần nhiều giao lộ lớn, từ đây việc di chuyển đến và đi cực kì nhanh chóng, an toàn và thuận tiện.\n- Không những vậy, xung quanh còn gần rất nhiều tiện ích như cửa hàng tiện lợi, Bách hóa xanh, trường học, khu vui chơi, trung tâm thương mại, cửa hàng mua sắm, giải trí,..\n- Bên cạnh đó, tòa nhà còn nhiều tiện ích đi kèm như:\n+ Camera an ninh 24/24\n+ Bảo vệ 24/24\n+ Cửa vào vân tay\n+ Thang máy\n+ Dọn dẹp vệ sinh hành lang hàng tuần.\n-------------------------\n!!Hiện giá phòng đang được ưu đãi giá chỉ còn 5tr/tháng (giá gốc 5tr5)\n??Chần chừ gì nữa mà không liên hệ ngay cho chúng tôi, Vũ, để được tư vấn tận tâm và dẫn đi xem nhà miễn phí.', 1050, 105, 5000000, '04edb6ed7a910cbaf87e110a1d75b808-2778008752671230456.jpg', 0, '', '10.7697,106.66477', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:53'),
