(5257, 93920022, 2147483647, 'Phòng trọ giá rẻ mới xây ở huyện nhà bè (có gác)', 'Phòng trọ giá rẻ ở đường Nguyễn Văn tạo, Huyện Nhà Bè, tp.HCM.\nPhòng mới xây, giờ giấc tự do, sạch sẽ thoáng mát, nhà vệ sinh riêng, an toàn, có gác lững.\nĐiện, nước có đồng hồ riêng. Giá điện tính theo đơn giá nhà nước, giá nước 20k/ khối.\nVị trí phòng cách trường cấp 3 Long Thới 500m và cách khu công nghiệp Hiệp Phước 2km.\nĐịa chỉ : 166/2 Nguyễn Văn Tạo, X. Long Thới, H. Nhà Bè\nMọi người có nhu cầu xin liên hệ số điện thoại bên cạnh gặp anh Đức Xin cám ơn.\nGiá tiền: 1.600.000 đ\nTiền cọc : 1.600.000 đ\nDiện tích: 20m2', 1050, 118, 1600000, 'c90fb9444d7749e8217008da539f5d23-2767737262014888069.jpg', 0, '', '10.654,106.72915', '[{\"id\":\"size\",\"value\":\"20 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:54'),
(5258, 84520621, 2147483647, 'Phòng trọ Trường Chinh Tân Bình gác cao 1m8 25m2', '⛔Chính chủ cho thuê phòng trọ TÂN BÌNH - \n=> Nhiều ưu đãi nhân dịp khai trương nhà mới.\n? 83/41 Phạm Văn Bạch, P.15, Tân Bình.\n- Vị trí: Cách mặt tiền Trường Chinh 50m, cách Big C Trường Chinh 500m, cách ĐH Công Nghiệp Thực Phẩm 1Km,....\n? MỚI XÂY 100% - PHÒNG CHƯA QUA SỬ DỤNG - GIỜ GIẤC TỰ DO\n⛔ CAM HẾT ẢNH CHỤP PHÒNG THỰC TẾ 1000%\n?Giá thuê phòng trống:\n+ 25m2 - có gác cao 1m8, 1 cửa sổ thoáng, kệ bếp: 2tr800/tháng\n+ 28m2 - có gác cao 1m8, 2 cửa sổ thoáng, kệ bếp: 3tr000/tháng\n+ 30m3 - có gác cao 1m8, 2 cửa sổ, kệ bếp, ban công: 3tr400/tháng\n? Hỗ trợ nội thất theo yêu cầu với giá cực rẻ.\n? Gác đúc cao 1m8 không đụng đầu, ở 3 - 4 người thoải mái.\n? Hầm xe rộng rãi có bảo vệ 24/7, thang máy hiện đại.\n? Bảo vệ an ninh 24/7, camera an ninh, không chung chủ.\n? Dịch vụ đầy đủ: Wifi, máy giặt, đổ rác, vệ sinh hành lang,...\n? Nuôi thú cưng, bạn bè tới chơi thoải mái.\n? Cách chợ 50m, có tạp hóa, quán cơm, quán coffee trong tòa nhà.', 1050, 112, 2800000, '4f946588af74bebedbbdf7e53c1da79d-2746709824244346117.jpg', 0, 'Đường Phạm Văn Bạch', '10.82134,106.63849', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:54'),
