(5260, 84769456, 2147483647, 'CHDV_Full NT cho thuê Dài Hạn_Ngắn Hạn TrungTâm Q7', 'HỆ THỐNG CĂn hộ CAO CẤP MINI CHO THUÊ\nTẠI QUẬN 7\n\n? Vị trí thuận tiện\n- Ngay khu dân cư mới gần cầu Kênh Tẻ, chỉ 2p ra Lotte Mart, 5p qua Q4, Q1, Q8 . 10p qua Q5.\n- - Gần Sunrise city, khu căn hộ, Sc vivo, Khu Him Lam, Gym, Hồ bơi...\n\n? Đầy đủ nội thất _ mới chưa một lần sử dụng\n- Máy lạnh, tủ lạnh, máy nước nóng lạnh;\n- - Giường, nệm, rèm cửa;\n- Kệ bếp, tủ bếp, tủ đồ, bếp điện, bàn làm việc.\n- - Vòi tắm hoa sen, gương tắm, lavabo, thanh treo đồ inox;\n\n? Căn hộ có cửa sổ và ban công thoáng mát\n\n? Dịch vụ miễn phí\n• Hệ thống PCCC\n• • Hệ thống khóa vân tay thông minh\n• Camera an ninh 24/7\n• • Vệ sinh khu vực chung hàng tuần\n• Máy giặt và máy sấy free\n\nGIÁ:\n➖ Dạng Studio: 5.000.000đ - 8.000.000đ\n➖ Duplex: 5.000.000đ - 6.000.000đ - 7.000.000đ\n➖ 1 Phòng ngủ : 7.000.000đ - 9.000.000đ\n\nHợp đồng : 01 - 03 - 06 - 09 - 12 Tháng\n\n?? Nhanh tay liên hệ Mr Cường (zalo/viber/whatsap) để được hỗ trợ thêm nhé !!!', 1010, 102, 6000000, '38222c48bb710be05cb3f207cec707b2-2715394129400608551.jpg', 1, 'Đường Nguyễn Thị Thập', '', '[{\"id\":\"size\",\"value\":\"40 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:54'),
