(5264, 96207892, 2147483647, 'BDS HÙNG VĨ LAND  5x20, 4 pn, 5wc giá thuê 25tr', 'BDS HÙNG VĨ LAND [NC] 5x20, 4 pn, 5wc giá thuê 25tr 20/06/2022\n\n✓ Cụ thể: Hợp đồng 2-5 năm. Cọc 2 tháng. Xem nhà hẹn trước 2h.\n\nBáo giá sẽ biến động theo thời gian - Liên hệ ngay để có giá tốt .\nBáo giá có giá trị trong 10 ngày - Kể từ ngày đăng tin: 20/06/2022\n\n\nLiên hệ: Anh Hùng (32 Tuổi). \nCÔNG TY TNHH ĐẦU TƯ VÀ XÂY DỰNG ĐỊA ỐC HÙNG VĨ\nVăn Phòng: 75 Đường 14, KDC Phước Bình, Thủ Đức City, HCMC\n\n- Chuyên bán Biệt Thự + Mặt Tiền Từ 10 - 99 tỉ\n\nHùng Vĩ Land - Chuyên bán tất cả các bất động sản các phường: Phước Long A + B; Tăng Nhơn Phú A + B; Phước Bình; Hiệp Phú Q9.\nBình Trưng Đông + Tây; An Phú, An Khánh, Thảo Điền Quận 2; Trường Thọ; Bình Thọ; Linh Chiểu Thành phố Thủ Đức.\n\n- Dự án: Khang Điền, Gia Hòa, An Thiên Lý, Nam Long, Kiến Á, Hưng Phú 12, Đông Thủ Thiêm, Phú Nhuận 10ha, Địa Ốc Sài Gòn, Trường Thịnh 64.\nValora Nam Phan, Valora Kykio, Valora Fuji, Riviera Cove, Rio Vista, River Park, Venica, Verosa Park, Villa Park, Lucasta, Park Riverside,Mega Residense Mega RuBy,\nMega Village, Melosa Garden, Verosa, Venica, The Classis, merita, Golf Park, SIMCITY, VALENCIA , Tocontap, Garland, Phố Đông village, sol village, Lucky Dragon, Victoria Village, Lakeview city.', 1020, 119, 25000000, '02fc6d5f955790be43ab0fb323ff4520-2777784029516346516.jpg', 4, '', '10.81398,106.77065', '[{\"id\":\"size\",\"value\":\"100 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"5 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:55'),
