(5273, 96207844, 2147483647, 'Cho thuê gấp CH mini ngay khu trung tâm Q6', 'Cần cho thuê gấp căn hộ tập thể tầng 2 trong  khu nhà 4 tầng, mỗi tầng là 1 nhà riêng biệt,  chỉ chung lối đi cầu thang và nhà để xe.\nCăn hộ full nội thất đến từng cái nồi, chén, chỉ cần xách quần áo vào ở : sofa giường xịn, 2 tủ quần áo, tủ tv to, quạt, máy lạnh, internet tivi, đầu đĩa, máy giặt, tủ lạnh mới, đều inverter, bếp điện, máy tắm nước nóng\nBan công rộng , thoáng mát, cửa sổ to, nhà luôn sáng sủa, trong hình là nhà chưa dọn dẹp, trước khi giao nhà sẽ có dịch vụ qua dọn dẹp chà rửa sạch sẽ.\nGiờ giấc tự do, khu vực trung tâm Q6, cách chợ Bình Tây 3p đi bộ, vào kv Q1 tầm 15p xe máy, kv tập trung nhiều Ngân hàng, BV, trường học từ mầm non đến ĐH, siêu thị, khu phố ăn uống của Q6.\nLiên hệ xem nhà ngoài giờ hành chính nhé !', 1010, 101, 3700000, '66ad557686d7bd426d45667e6c3a2eda-2778008325656188708.jpg', 1, '', '10.74967,106.64846', '[{\"id\":\"size\",\"value\":\"40 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:57'),
(5274, 96041378, 2147483647, 'Cho Thuê Nhà HXH Né Nhau Đường Nguyễn Gia Trí', 'Cho thuê nhà nguyên căn hẻm xe hơi né nhau đường Nguyễn Gia Trí, Phường 25, Quận Bình Thạnh\n\nDiện tích: 4m x 10m\n\nKết cấu 1 trệt, 2 lầu, sân thượng\n\nNhà có 4 phòng ngủ, 3 toilet\n\nHẻm 6m 2 xe hơi né nhau vô tư, nội thất có sẵn máy lạnh, tủ, quạt,...\n\nChủ nhà rất là thân thiện luôn\n\nKhu vực an ninh, yên tĩnh. Khu vực nhiều văn phòng công ty, trường học,...\n\nGiá thuê 16 triệu/tháng', 1020, 109, 16000000, '9da4e7995116c8e654df8782c6b86a3f-2777260631847282004.jpg', 3, '', '10.80619,106.71607', '[{\"id\":\"size\",\"value\":\"40 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"4 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:57'),
