(5276, 96207829, 2147483647, 'NR THANH XUÂN, OTO VÀO NHÀ. 50M2. 4TẦNG .4NGỦ.3WC.', 'CHO THUÊ NHÀ RIÊNG TẠI THANH XUÂN - NGÃ TƯ SỞ.\n- Địa chỉ: Vương Thừa Vũ, Khương Trung, Thanh Xuân, HN.\n- Diện tích: 50m2*4tầng.\n- Tầng 1: Gara oto, bếp, wc.\n- Tầng 2,3: Mỗi tầng 2ngủ 1wc\n- Tầng 4: Khu thờ, sân phơi.\n- Nội thất: Điều hoà, nóng lạnh, giường tủ....\n- Ngõ rộng oto để trong nhà.\n- Phù hợp hộ gia đình ở và kd online, văn phòng...\n- Giá 14tr.\n- Thanh toán 3-6 tháng cọc 1.', 1020, 77, 14000000, '21e630fadf9997141c34f4caa33f0703-2778007883735524576.jpg', 3, '', '21.0012,105.822', '[{\"id\":\"size\",\"value\":\"50 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"4 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:57'),
