(5279, 95799633, 2147483647, '?? Cho thuê căn hộ 1PN -2PN Jamona City Quận 7', 'Cho thuê căn hộ chung cư Jamona City đường Đào Trí quận 7:\n\n* Căn 55m2 (1PN - 1WC): 6 triệu/tháng (nhà trống).\n\n* Căn 62m2 (2PN - 1WC): 6.5 triệu/tháng (tủ bếp rèm).\n\n* Căn 73m2 (2PN - 2WC): 7 triệu/tháng (tủ bếp rèm).\n\n* Căn 55m2 (1PN - 1WC): 7.5 - 8 triệu/tháng (đầy đủ nội thất).\n\n* Căn 62m2 (2PN - 1WC): 8 - 8.5 triệu/tháng (đầy đủ nội thất).\n\n* Căn 73m2 (2PN - 2WC): 8.5 - 9 - 10 - 11 triệu/tháng (đầy đủ nội thất).\n\n- Phí quản lý: 270.000đ/tháng (1PN - 1WC), 350.000đ/tháng (2PN - 1WC), 420.000đ/tháng (2PN - 2WC).\n- Phí gửi xe: 70.000đ/xe máy/tháng, 700.000đ/ô tô/tháng.\n- Điện, nước, cáp nét: Theo hóa đơn nhà nước.\n\n* Hỗ trợ đăng ký dọn vào chung cư, đăng ký xe, thủ tục tạm trú đặc biệt cho người nước ngoài, định mức nước...\n\nTiện ích đã có:\n- Hồ bơi, 2 siêu thị, gym, yoga, spa, shop ăn uống, cafe, khu vui chơi trẻ em, sân tennis, hồ Thiên Nga 7,500m2.\n- Bảo vệ 24/24, an ninh yên tĩnh.\n\nĐịa chỉ: 722 Đào Trí, Q7, cách cầu Phú Mỹ 100m, các căn đều view sông, hồ thoáng mát, đi Q1 - 10 phút, Q2 - 5 phút.\n\n*** Ngô Quyền \n(Nhận ký gửi chung cư nhà phố mặt bằng kinh doanh tại sài gòn).', 1010, 102, 6000000, 'f6e24d7045a4480904a91d4298cf4000-2776213457441858746.jpg', 1, '', '10.712963,106.74326', '[{\"id\":\"size\",\"value\":\"50 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:58'),
(5280, 90310612, 2147483647, 'PHÒNG TRỌ GÁC LỬNG ĐẸP QUẬN TÂN BÌNH', '- Đ. Chỉ: 116/30 Huỳnh Văn Nghệ, phường 15, Q. Tân Bình.\n- Giá phòng: 2,2 triệu/tháng (Cọc 2,0 triệu).\n- Liên hệ: \n- Điện 3.5k/Kw.\n- Nước 15k/m3 (nước máy).\n- Xe 95k/1xe.\n- Mở cửa 5h - 23h30. \n- Phòng đẹp 20m2, có gác lửng, WC riêng, kệ bếp, chậu rửa chén, thoáng mát, để xe tầng hầm, có chỗ phơi đồ riêng, Camera giám sát 24/7, đường xe tải, khu vực an ninh.\n- Gần ngay sân Golf sân bay Tân Sơn Nhất, thông ra Phạm Văn Bạch, Phan Huy Ích, Quang Trung . . . Cách ngã 3 Phạm Vă Bạch & Trường Chinh 1km. Cách ETown 3km. Gần nhiều trung tâm tiện ích như Pandora, Siêu Thị CoopMart . . .', 1050, 112, 2200000, '705fa6ba055d1fce225f3efdf937869c-2749455766083613576.jpg', 0, 'Đường Huỳnh Văn Nghệ', '10.83009,106.63796', '[{\"id\":\"size\",\"value\":\"20 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:59'),
