(5282, 95928736, 2147483647, 'Smart Dorm cho thuê Box tại Quận 7 _ An ninh', 'Mô hình Dorm (Ký túc xá kiểu Nhật) đã xuất hiện tại Thành phố Hồ Chí Minh.\n\nVị trí Nguyễn Văn Quỳ, Quận 7\n\nĐầu tiên là Không gian được tách biệt hoàn toàn. Không như ở KTX, Mô hình Smart Dorm chú trọng sự riêng tư và môi trường làm việc biệt lập của mỗi cá nhân.\n\nỞ Smart Dorm, mọi điều kiện sinh hoạt tiêu chuẩn được đảm bảo: Khoá vân tay, điều hoà, bình nước nóng, máy giặt, bếp điện từ, full nội thất tiện nghi, WC cao cấp.\n\nTại Smart Dorm, sức khỏe và thể chất được coi trọng: Với phòng bếp rộng với đầy đủ trang thiết bị cao cấp, tạo điều kiện thuận tiện  để mọi thành viên đều có 1 bữa ăn ngon, sạch, tiết kiệm, ấm cúng như 1 gia đình.\n\nViệc phát triển trí lực, bồi dưỡng linh hồn mỗi cá nhân là yếu tố then chốt, mọi cá nhân được đào tạo toàn diện và miễn phí guitar, tiếng anh, kỹ năng mềm, lập trình tư duy 24/7.\n\nỞ Smart Dorm, liên kết đội nhóm, cùng nhau hành động là mục đích cuối cùng, cùng nhau xây dựng 1 khối thống  mà mỗi cá nhân là 1 người kiệt xuất cùng sống hết mình với những đam mê nhảm nhí, cùng triển khai những dự án điên rồ. Nếu bạn dám nghĩ mình thay đổi Thế Giới.\n\nGiá: 1,4 - 1,6 triệu/ Dorm , đầy đủ nội thất cao cấp, dọn vào là ở luôn.\nLiên hệ Hoàn để xem nhà.', 1050, 102, 1600000, '7d85efc045ddcb25eee2d7874a38fb46-2776803097047567235.jpg', 0, '', '10.73998,106.70365', '[{\"id\":\"size\",\"value\":\"8 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:12:59'),
(5283, 88197653, 2147483647, 'CHÍNH CHỦ . CĂN HỘ SIÊU SỊN , MIỄN PHÍ DỊCH VỤ', '1. CCMN 1K1N FULL ĐỒ NGUYỄN KHÁNH TOÀN, CẦU GIẤY SIÊU XỊN CHỈ  6TR MIỄN PHÍ D.VỤ . ( Vào ở được ngay ) chỉ việc xách vali vào ở . CHO NGƯỜI NƯỚC NGOÀI ,VIÊT NAM Thuê Căn hộ dịch vụ cao cấp, 10 tầng thang máy hiện đại GIÁ SỐC \n- Phòng ngủ: điều hòa 2 chiều, giường, chăn ga gối đệm cao cấp cotton 100%, tủ q.áo, tủ đầu giường, bàn ghế, cây treo q.áo\n- Phòng khách liền bếp: điều hòa, bàn ghế sofa, tivi, tủ lạnh, hệ thống tủ bếp 2 tầng xịn xò, máy hút mùi, lò vi sóng, sẵn bộ đồ bếp núc đầy đủ...Vệ sinh hiện đại, cabin tắm đứng, bình nóng lạnh, thiết bị vệ sinh inox\n- Camera an ninh, bảo vệ 24/24, giờ giấc thoải mái không chung chủ.\n- ĐẶC BIỆT MIỄN PHÍ TOÀN BỘ DỊCH VỤ: truyền hình, internet, máy giặt, máy sấy, dọn phòng 2 lần/tuần, thay chăn ga gối 2 tuần/lần\nChỉ  mất phí để xe 100k/xe! \n- Đóng 1 cọc 1, vào ở được ngay\n- 40m2 / 6 tr hoặc 50m2 /7tr\n- ở ngày căn 40m/400k/ngày : căn 50m/450k/ngày : ở tuần căn 40m/2.100k/tuần ; căn 50m/2500k/tuần . Ngõ rộng rãi, ngay gần mặt đường lớn\n2.CCMN  FULL ĐỒ TRẦN THÁI TÔNG , CẦU GIẤY SIÊU XỊN CHỈ 5 TR . MIỄN PHÍ D.VỤ.\nCăn hộ dịch vụ cao cấp, 7 tầng thang máy hiện đại GIÁ SỐC \n- 28m2 /5.5 tr : 35m2 /6tr hoặc 40m2 / 6.5tr \n- Ngay gần mặt đường lớn Xuân Thủy , Thần Thái Tông .\nDỊCH VỤ NHƯ TÒA SỐ 1 : MỜI CÁC QÚY  KHÁCH CÓ NHU CẦU ONLINE QUA  ZALO ĐỂ ĐƯỢC  NHẬN HÌNH ẢNH , VIDEO . TƯ VẤN TRỰC TIẾP  , THĂM CĂN HỘ trực tiếp / trực tuyến.\nCẢM ƠN QUÝ KHÁCH ĐÃ QUAN TÂM TỚI RICHLAND', 1010, 79, 6000000, 'e2a7f40aa0f025c23f0b14be4ead46bc-2738951919238105248.jpg', 1, 'Đường Nguyễn Khánh Toàn', '21.03815,105.80036', '[{\"id\":\"size\",\"value\":\"40 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:12:59'),
