(5303, 95687229, 2147483647, 'Cho Thuê Căn Hộ Giá Tốt tại Vinhomes Grand Park', 'Cám ơn Anh/Chị đã quan tâm tới bài viết này!\n\nHiện tại,e còn sẵn một số căn hộ cần cho thuê\nCác căn hộ tại khu Vinhomes Grand Park đều đã có sẵn máy lạnh,có nội thất cơ bản nhưng chưa có kệ bếp và rèm cửa (E có để hình ảnh minh hoạ căn có bếp và căn không có bếp để mọi người hình dung ạ)\n\nCăn Studio:30m2-4tr/tháng\nCăn 1PN:47m2-4tr5/tháng\nCăn 2PN:59m2-5tr/tháng\nCăn 3PN:81m2-6tr5/tháng\n\nNgoài ra,các căn có lắp đặt bếp rèm thì tăng thêm 500k-1 triệu\nCác căn đầy đủ nội thất giá từ 6tr5-8tr tuỳ vào số lượng và chất lượng của nội thất \n\nCác chi phí trong quá trình sinh hoạt tại Vinhomes\nPhí quản lý:8k8/m2\nPhí gửi xe máy:150k/tháng\nPhí gửi xe oto:1250k/tháng\nĐiện nước tính theo giá nhà nước\n\nAnh/chị cần thuê căn hộ tại Vinhomes Grand Park\nLiên hệ SĐT hoặc Zalo *** e Nam ạ', 1010, 119, 4500000, 'ba5ed3783c90f1634d11064ade60370a-2775695598053406923.jpg', 1, '', '10.848276,106.83148', '[{\"id\":\"size\",\"value\":\"47 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:04'),
