(5328, 96207603, 2147483647, '⛔Duplex - Nhà mới full nội thất  -Tòa nhà Viettel⛔', '? Nóng hổi, căn hộ duplex, không duplex mới ra lò đâyyyyyy ?\n    ?Vị Trí: CÁCH MẠNG THÁNG 8, KẾ QUẬN 10 ( đối diện tòa nhà Viettel )\nPhòng có giá từ 5tr đến 7tr: \n       ?Phòng duplex nội thất đầy đủ :\n? Cửa sổ lớn, duplex gọn gàng sạch sẽ\n? Kệ bếp, toilet riêng\n? Nệm, máy lạnh, quạt\n       ? Phòng studio nội thất đầy đủ : \n☘️ Cửa sổ lớn, phòng mới gọn gàng sạch sẽ \n☘️ Giường nệm, tủ đồ, máy lạnh, quạt \n☘️ Kệ bếp, toilet riêng\n? Giờ giấc tự do, không chung chủ, có hầm xe \n?  Vị trí trung tâm thuận lợi ( Dễ dàng đi tới các quận 1,3,5,10. Gần các trường đại học Kinh tế, Huflit, Hoa sen,.. )\n     ? Hifriendz HỖ TRỢ CỌC ?\n         ?? Còn gì mà không mau liên hệ đê??', 1050, 98, 5000000, '6f53e8bb3c43a45999677c3d40b30176-2778006916845561765.jpg', 0, '', '10.78063,106.67639', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:10'),
(5329, 95970198, 2147483647, 'Trọ có gác cho thuê gần Trường Chinh - Tân Bình', 'Địa chỉ: 66B Nguyễn Sỹ Sách, P. 15, Tân Bình\n- Phòng hiện đại, sạch sẽ\n- Nội thất: từ cơ bản đến đầy đủ (tùy nhu cầu khách)\n- Phòng có cửa sổ bao thoáng mát\n- Hầm để xe rộng rãi có bảo vệ trông coi\n- Khu vực sống văn minh, an ninh\n- Tiện ích: gần trường ĐHCN thực phẩm chỉ 5 phút di chuyển, Winmart ngay dưới tòa nhà, gần chợ Tân Trụ chỉ 5 phút di chuyển (có thể đi bộ)\n- Thuận tiện di chuyển: Tân Phú, Bình Tân, Q. 12, Gò Vấp, ...', 1050, 112, 3500000, 'cf9bdcc0e48b26556c1f9670ee97c931-2776969126639163664.jpg', 0, '', '10.82034,106.637', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:10'),
(5330, 96207582, 2147483647, 'Đất cho thuê gần bến xe Trung Tâm Đà Nẵng', 'Diện tích lô: Lô 114,4m2 (5mx21m) Mặt tiền: 5m nở hậu 5,9m. \nHướng: Đông Bắc. \nGiá cho thuê 3,5triệu/tháng.\n(có thương lượng cho khách thiện chí).\n+ lô đất mặt tiền, bằng phẳng, thuận tiện giao thông, ngay gần Bến Xe Trung Tâm Đà Nẵng, đường Tôn Đức Thắng, khu TDTT SHB Đà Nẵng, Đại Học Duy Tân...\n+ Đường rộng hơn 5m( đường quy hoạch 10,5m vỉa hè 5m) quanh khu đất rộng rãi, an ninh tốt(ngày gần đất quân đội), xe lớn có thể đi vào nhận bốc hàng ko ảnh hưởng đến xung quanh.\n+ lô đất đang trống, anh/chị thuê có thể tự làm nhà xưởng theo nhu cầu, làm kho bãi chứa hàng, chủ thân thiện, dễ tính, cho thuê hợp đồng lâu dài.', 1040, 17, 3500000, 'ac11145f14b80a9a96c2284096b471c6-2778006548551864025.jpg', 0, '', '16.03962,108.15195', '[{\"id\":\"size\",\"value\":\"114 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:10'),
