(5332, 96207561, 2147483647, '?A/C KINH DOANH QUÁN NHẬU ĐỪNG BỎ QUA TIN NÀY', 'Cho Thuê Mặt Bằng 2 Mặt Tiền \nXô Viết Nghệ Tĩnh, Gần Nguyễn Hữu Thọ\n- Diện tích : 9m x 25 m  , góc 2 mặt tiền , đã có sẳn bạt kéo , phòng ở lại , tolet nam nữ , điều hoà \n- Phù hợp làm quán nhậu , cafe ,....\n- Giá : 40 triệu / tháng\nXem MB Gọi Em Trước 30P Em Cám Ơn Ạ\nCó gì anh chị gọi trực tiếp em nha . Giờ nào cũng sẵn lòng ạ ^^', 1030, 17, 39900000, '2c09f4296d124e567c0d3a2eb7a529fd-2778006515643934629.jpg', 0, '', '16.0344,108.23098', '[{\"id\":\"size\",\"value\":\"225 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:11'),
