(5334, 80038225, 2147483647, 'Phòng trọ Cộng Hòa có máy lạnh gác cao 1m8 mới xây', '⛔Chính chủ cho thuê phòng trọ TÂN BÌNH\n=> Nhiều ưu đãi mừng khai trương nhà mới.\n? 622/10 Cộng Hòa, P.13, Tân Bình ngay Etown Cộng Hòa thuận tiện đi lại các quận trung tâm\n? MỚI XÂY 100% - PHÒNG CHƯA QUA SỬ DỤNG - GIỜ GIẤC TỰ DO\n⛔CAM KẾT HÌNH ẢNH CHỤP THỰC TẾ 1000%.\n?Giá thuê phòng trống:\n- 25m2 - gác cao 1m8, kệ bếp, 2 cửa sổ:\n+ Nội thất cơ bản: 3tr500/tháng \n+ Full nội thất (máy lạnh, tủ lạnh, kệ tủ quần áo,...): 4tr100/tháng\n- 30m2 - gác cao 1m8, kệ bếp, 2 cửa sổ, ban công:\n+ Nội thất cơ bản: 3tr900/tháng \n+ Full nội thất (máy lạnh, tủ lạnh, kệ tủ quần áo,...): 4tr500/tháng\n? Gác đúc cao 1 mét 8 không đụng đầu, ở 3 - 4 người người thoải mái.\n? Kệ bếp nấu ăn thoải mái, toilet riêng.\n? Hầm xe rộng có bảo vệ 24/7, thang máy hiện đại.\n? Bảo vệ an ninh 24/7, camera an ninh, không chung chủ.\n? Dịch vụ đầy đủ: Wifi, MÁY GIẶT, quản lý bảo vệ 24/24, đổ rác, vệ sinh hành lang,...\n? Nuôi thú cưng, bạn bè tới chơi thoải mái.\n? Cách chợ 50m, có tạp hóa, quán cơm, quán coffee trong tòa nhà.', 1050, 112, 3500000, '546d8487b4bf4cc333a85678b2d26fb4-2753444141174189986.jpg', 0, 'Đường Cộng Hòa', '10.8019,106.64857', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:11'),
(5335, 96142636, 2147483647, 'CĂN HỘ 1PN ngay Cityland và Lotte Nguyễn Văn Lượng', 'CĂN HỘ DỊCH VỤ 1 PHÒNG NGỦ CÓ BAN CÔNG + ĐẦY ĐỦ NỘI THẤT \n\n• 276 Thống Nhất, Phường 16, Gò Vấp \n\n- Kế bên Lotte Mart Nguyễn Văn Lượng, Bách Hoá Xanh, Chợ Hạnh Thông Tây \n\n- Galaxy Quang Trung, Beta Quang Trung, Siêu Thị, Vincom \n\n- Giáp Phan Văn Trị, Nguyễn Văn Lượng, Lê Văn Thọ, Nguyễn Oanh, Quang Trung … \n\n• 1 giá  : 6 TRIỆU 5 \n\nLiên hệ ngay: Quỳnh Anh và Thuỳ Giang tư vấn và hỗ trợ xem phòng nhanh   nhé', 1010, 110, 6500000, '74b5c339883802749e8edbae42a8be50-2777718796480980208.jpg', 1, '', '10.845848,106.664856', '[{\"id\":\"size\",\"value\":\"45 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:11'),
(5336, 96207529, 2147483647, 'Phòng Ban công rộng thoáng nội thất mới', '?STUDIO CAO CẤP MẶT TIỀN SÁT QUẬN 1?\n❗️ Trần Đình Xu, phường Đakao, Q1\n\n? FULL NỘI THẤT GỒM: Tivi , máy lạnh, tủ lạnh, máy nước nóng, sofa, giường nệm, kệ bếp, tủ quần áo,bếp, ...\n\n? TIỆN ÍCH VÀ DỊCH VỤ\n- Dọn phòng 2l/tuần, thay ga 1l/tuần\n- Giờ giấc tự do\n- Camera an ninh, bảo vệ 24/7\n- Thang máy\n- Free chi phí , trừ điện nước \n\n? VỊ TRÍ THUẬN LỢI di chuyển sang Q1, Q3, Q10, Q3, Bình Thạnh,...', 1010, 96, 10000000, 'ee10b1f25507464948bb59d03b38a22b-2778006499380586160.jpg', 1, '', '10.76055,106.69145', '[{\"id\":\"size\",\"value\":\"40 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:12'),
