(5341, 95436233, 2147483647, 'Chuyên cho thuê D\'Lusso 1-2-3PN giá rẻ', 'Căn hộ cao cấp D\'Lusso, 1 + 1PN, 49m2, giá 8 triệu/tháng\n\n- Diện tích: 50m2, thiết kế 1PN, Giá chỉ 8triệu/th.\n- Diện tích: 54m2, thiết kế 1PN+1, Giá chỉ 8,5triệu/th.\n- Diện tích: 70m2 2PN - 2WC chỉ 9triệu/th.\n- Diện tích: 105m2 3PN - 2WC chỉ 12triệu/th.\n\n- Nội thất: Gồm sàn gỗ, 02 máy lạnh, máy nước nóng, tủ kệ bếp trên dưới...thiết kế NT theo yêu cầu khách hàng. Có nhiều SP để lựa chọn.\n- Nằm trong khu chung cư cao cấp hiện đại, sang trọng và đẳng cấp, nhà mới, đẹp.\n- Hồ bơi đẹp, gym, view thoáng mát, môi trường không gian xanh trong lành yên tĩnh, an ninh 24/24 có camera, nhiều tiện ích được miễn phí.\n- Vui lòng liên hệ. A. Phong', 1010, 119, 8000000, '4673_overview_1.jpg', 2, '', '10.77618,106.69653', '[{\"id\":\"size\",\"value\":\"70 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:13'),
(5342, 93929693, 2147483647, 'cho thuê phòng trọ có ban công MT Luỹ Bán Bích', 'Chính chủ cho thuê phòng trọ,sạch đẹp,thoáng mát,có ban công view mặt tiền Luỹ Bán Bích,khu vực an ninh,dân trí cao\nPhòng rộng rãi thoải mái,cách trường CĐ công nghệ thông tin chỉ vài phút đi bộ\nSinh viên thuận tiện đi học ở các trường đại học cao đẳng như: CĐ công nghệ thông tin,CĐ GTVT,ĐH Hoa Sen,ĐH công nghiệp thực phẩm chỉ 3-7p\nNhân viên văn phòng công sở thuận tiện đi làm các khu vực Tên Lửa,Aeon mall Tân Phú,công viên Đầm Sen,trung tâm quận Tân Bình chỉ từ 7-10p di chuyển\nNhà nằm trên mặt tiền Luỹ Bán Bích,kết nối giao thông thuận tiện các quận Bình Tân,Tân Phú,quận 6,Tân Bình,Quận 11\nƯu tiên: sinh viên,nhân viên văn phòng', 1050, 113, 2500000, '8fb85fefe8f88d6199c54f836a54c5c4-2767792569877606340.jpg', 0, '', '10.77869,106.63521', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:13'),
