(5366, 96166910, 2147483647, 'Chính chủ cho thuê nhà mới 100% 3 lầu ngay QL13', 'Chính chủ cho thuế nhà mới 100% 3 lầu ngay QL13 đương xe hơi: \n\n- DTSD: 180m2 \n- Nhà thiết kế 1 trệt 1 lửng 2 lầu 4 PN 1 phòng khách 4 WC trang bị máy nóng lạnh\n- Nhà thích hợp kinh doanh và ở có camera an ninh \n- Nhà mới chưa qua sử dụng \n- Giá thuê: 15tr/ tháng bớt lộc cho khách thiện chí\n\nLiên hệ: em Nhân xem nhà thực tế. \nCảm ơn A/C đã xem tin em!', 1020, 119, 15000000, '7158f726726be8dfb0478f99ebb0cd6a-2777836463341883417.jpg', 4, '', '10.85144,106.72004', '[{\"id\":\"size\",\"value\":\"60 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"4 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:19'),
(5367, 96207393, 2147483647, 'CHDV ban công tách bếp full nội thất 30m2', 'Trống 1 căn , căn hộ siêu đẹp tại Tăng Bạt Hổ, sát Văn Lang cơ sở 2, thuận tiện di chuyển qua các đường Phạm Văn Đồng, quận Phú Nhuận,... \nCăn hộ gần chợ, siêu thi và các tiện ích ngoại khu khác. \n? Diện tích : 25m2 giá 6.700.000 (cuối tháng trống)\n30m2 giá 7.500.000 (cuối tháng trống)\n\n- Điện 4k/kwh\n- Nước 100k/người\n- Phí dịch vụ 150k/phòng\n- XE FREE\n\n?Có chỗ giữ xe rộng rãi , khoá vân tay cực kỳ an ninh\n? Nhà mới, có thang máy\n?Giờ giấc tự do, không chung chủ\n\nGỌI ĐIỆN ĐẶT PHÒNG NGAYYY !!!', 1010, 109, 6700000, 'ca319bbc59a0f88b8367881579465b03-2778004769418840568.jpg', 1, '', '10.81097,106.69381', '[{\"id\":\"size\",\"value\":\"30 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:20'),
(5368, 90485890, 2147483647, 'PHÒNG KÝ TÚC XÁ FULL NỘI THẤT, MÁY LẠNH, QUẬN 7.', '- Địa Chỉ: Số 8 Đường Số 2, phường Phú Mỹ, Quận 7 ( Số 258 Phạm Hữu Lầu rẽ vào) - Gần ngã 4 Nguyễn Lương Bằng - Phạm Hữu Lầu.\n\n- Giá chỉ từ 1,2triệu/người.\n\n- Liên hệ: .\n\n- Miễn phí:  Điện, nước, chỗ để xe, wifi, máy giặt, máy lạnh, tủ lạnh . . .\n\n* Giờ tự do, Camera giám sát an ninh 24/7.\n\n* Phòng đôi rộng 45m2, có phòng ngủ riêng, bếp & phòng ăn riêng  (chỉ đặt 4 giường 2 tầng/phòng). \n\n* Trang bị Full nội thất: Giường, tủ quần áo, máy lạnh, bàn ăn, máy giặt, tủ lạnh, nệm, drap, mền, gối, rèm... không gian riêng tư.\n\n* Có nhân viên dọn dẹp vệ sinh định kỳ, Sân phơi riêng.\n\n* Khóa cửa vân tay cực kì an ninh.\n\n- Vị trí trung tâm quận 7, Ngay bên cạnh chung cư Belleza, chung cư Era Town, gần các trung tâm lớn như Cresent Mall. ra cầu Ánh Sao chỉ mất 5 phút. . .', 1050, 102, 1200000, '3fd279fc0c9c26766f9179e2cc06809a-2750253961731677843.jpg', 0, 'Đường Số 2', '10.74248,106.5929', '[{\"id\":\"size\",\"value\":\"45 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:20'),
(5369, 96083268, 2147483647, 'Căn Hộ Ngô Bệ ngay Etown Cộng Hoà mới xấy full nt', '❌❌CĂN HỘ FULL NỘI THẤT NEW ??\n?Địa chỉ : Ngô Bệ p13 Tân Bình ngay etown cộng hoà , bigC trường chinh , lotte cộng hoà  , cộng hoà garden\n?Nội thất :\n-Máy lạnh , tủ lạnh , tủ quần áo , sofa , bàn ăn , tivi , giường niệm , kệ bếp , tủ bếp , máy hút khói , bếp điện , nước nóng lạnh , máy giặt riêng\n-Dạng phòng :\n+Studio ban công trước và sau\n+Căn hộ 1PN riêng ban công trước và sau\n-------\n✅✅ Dịch vụ toà nhà\n-Thang máy , hầm xe , camera bảo vệ an ninh 24/7\n-Ở được tối đa 4 người\n-ban công thoáng mát\n-------\n??Phí dịch vụ :\n-Điện 3.5k\n- Nước 100k người\n-Dịch vụ 200k phòng\n☎️Liên hệ xem phòng : Phong', 1010, 112, 8500000, '59cfebd2060e435949da7d575f047a23-2777467365517545099.jpg', 1, '', '10.80372,106.64162', '[{\"id\":\"size\",\"value\":\"50 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:20'),
