(5374, 96207361, 2147483647, 'Nhà hẻm xe hơi Cao Thắng, Q3 sau lưng tòa nhà ACB', 'Cho thuê nhà nhỏ tiện ở và kinh doanh HXH Cao Thắng, Phường 5, Quận 3\n\nVị trí: HXH 6m, xe ra vào thoải mái. cách mặt tiền 50m. Hẻm phía sau tòa nhà NH ACB. Sát ngã tư Cao Thắng - NTMK\n\n??? DT : 8m ngang x 3m sâu. Kết cấu 1 trệt 1 lầu, nhà đẹp đã hoàn công đủ . \n\n? Hướng: Tây Bắc\n\n? Pháp lý: sổ hồng đầy đủ. Mua bán công chứng trong ngày. \n\n?? Nhà này thuê bán cafe, cơm vp rất ổn. Do nhân viên ACB rất đông. Phía trên có thể dùng để ở. Vị trí thuận tiện kinh doanh cafe, cơm trưa văn phòng, cho thuê lấy dòng tiền. \n\n??Giá: 12 tr/tháng (thương lượng)\n\n☎️ LH: 090.2527.119 - Phát', 1020, 98, 12000000, 'd6c9b6e8b0db0ebb84e5192c8635111f-2778005792133574477.jpg', 1, '', '10.76967,106.68495', '[{\"id\":\"size\",\"value\":\"24 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:21'),
