(5376, 85831568, 2147483647, 'Lê Văn Sỹ,full nội thất,1P.bếp,1Pkhách,1Pngủ riêng', 'Camera an ninh 24/24, cửa Vân tay\n- Nhà cao cấp, trang thiết bị, sang trọng, hiện đại trong Khu Biệt thự nước ngoài, an ninh nghiêm ngặt đoạn giao nhau giữa Lê Văn Sỹ và Kỳ Đồng\n- Vị trí Là trung tâm quận 3, trung tâm sài gòn nên đi đứng rất tiện lợi. quận trung tâm bao giờ cũng an ninh hơn Quận rìa. Ra quận 1: 5 phút đi xe, Quận 5: 2 phút. Cách cầu Lê Văn sỹ 10 Bước chân, Ngay Chợ Nguyễn Văn Trỗi, đối diện đại học Sư Phạm. 3 phút ra đến Ga Sài Gòn\n----Căn Hộ 35m2 1 phòng ngủ ,1 phòng khách,bếp, sofa tiếp khách, giường, nệm, gối, tủ , bàn tiếp khách, máy lạnh, máy nước nóng, bồn tắm đứng: 35m2 giá 5.500.000đ\n----Căn Hộ 45m2 1 phòng ngủ cao cấp,1 phòng khách ,1 phòng bếp, bàn bếp, giường, nệm, gối, tủ , bàn tiếp khách, máy lạnh, tủ lạnh, máy nước nóng, bồn tắm đứng giá 6.500.000đ\n- Giờ tự do 24/24\n- Camera an ninh 24/24\n- Hệ thống máy nước nóng lạnh năng lượng mặt trời\n- Không chung chủ, bạn bè đến chơi thoải mái.\n- --ưu tiên Vợ chồng, nữ thuê sẽ được giảm giá', 1010, 98, 5500000, 'a618ca104df6aa034a956cc5b7fcdd07-2720025679946680812.jpg', 1, 'Đường Lê Văn Sỹ', '', '[{\"id\":\"size\",\"value\":\"45 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:21'),
(5377, 96172527, 2147483647, 'Tìm 1 bạn nam ở ghép SV or NVVP, phòng rộng 40m2', 'Tìm 1 bạn nam ở ghép SV or NVVP ...\nPhòng rộng 40m2, thoáng mát, sạch sẽ, đầy đủ nội thất, xe để trong nhà, cuối tháng dọn vào ở ngay...\nHẻm 1168, sát mặt tiền Trường Sa, xe tải thông ra Huỳnh Văn Bánh, ko bị ngập nước, kvuc trung tâm, gần sân bay TSN, 10p ra tới Q.1, Q.3; sát bên Tân Bình, Phú Nhuận,... \nỞ sạch sẽ, gọn gàng là được,...\nShare tiền phòng mỗi người 2,2tr/tháng. Điện 3,5k/1kg, nước 100k/tháng.\nLhe ***\nCọc 2,2tr...', 1050, 111, 2200000, 'f5965ebca75755cf95ac0882d605d9c4-2777858306338293995.jpg', 0, '', '10.78906,106.66824', '[{\"id\":\"size\",\"value\":\"40 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:22');
