(5380, 95656830, 2147483647, 'Sang KTX 28 Giường. Nơ Trang Long. Bình Thạnh', 'Sang KTX 28 giường. Nơ Trang Long. P13. Bình Thạnh\n- Vị trí gần các trường đại học lớn\n? D Tích: 8 x 14m. 2 lầu. Sân thượng.\nTổng 6 PN ( 2 ph đơn, 4 ph KTX có 28 giường ) \n? Giá Thuê: 14 triệu/tháng. Cọc 1 tháng. HĐ còn 2 năm. cho ký qua chủ có thể thương lượng gia hạn thêm. \n? Hiện đang kinh doanh tốt, setup full nội thất, 2 ph đơn và 18 giường khách đang ở còn trống 10 giường. Giá cho mỗi bạn 1tr4 bao phí dịch vụ. Trừ hết chi phú hiện tại đang lời. Full giường lợi nhuận sẽ đạt 15tr => 16tr/tháng.\n? Bận việc sang 80tr bao gồm: cải tạo sơn sửa, trang thiết bị, máy lạnh, camerra, khóa vân tay, máy giặt giường tầng v.v....\n- Cọc chủ 14tr bạn gửi riêng\n- Cọc khách gửi lại cho bạn\n- Giá sang có giảm cho khách chốt nhanh\n=> Nhận ký gửi cho thuê sang nhượng căn hộ, khách sạn v.v...\n☎️ 077777...0467. 090878....0467\nMr Dũng tận tình tư vấn', 1020, 109, 14000000, 'a77596d8d6f22408e449297e03f4e2f4-2775547507386650972.jpg', 7, '', '10.826654,106.70376', '[{\"id\":\"size\",\"value\":\"12 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"6 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:23'),
