(5389, 90208283, 2147483647, 'CHO THUÊ CH Q7 BOULEVARD LIỀN KỀ PMH GIÁ TỪ 7TR', 'Q7 Boulevard sở hữu nhiều tiện ích nội khu hoàn chỉnh, hiện đại - nơi bạn và gia đình sẽ được thư giãn bất tận trong làn nước mát lạnh của hồ bơi và khu công viên tràn ngập cỏ cây.\n\nCập nhật giá thuê.\n\n- 1PN - 1WC chỉ từ 7tr.\n- 2PN - 2WC chỉ từ 9tr.\n\nVị trí: Q7 Boulevard vươn mình kiêu hãnh ngay đại lộ Nguyễn Lương Bằng một trong những trục thương mại, tài chính sầm uất nhất khu Nam và liền kề đô thị kiểu mẫu Phú Mỹ Hưng hiện đại. Q7 Boulevard kiến tạo nên chốn an cư lý tưởng và ngập tràn hơi thở thiên nhiên giữa nhịp sống sôi động của Nam Sài Gòn.\n\nTiện ích: Chỉ cách khu đô thị Phú Mỹ Hưng vài bước chân, Q7 Boulevard thừa hưởng trọn vẹn những tiện ích đạt tiêu chuẩn quốc tế trong khu vực như các tổ hợp trung tâm thương mại siêu thị - dịch vụ giải trí, hệ thống y tế, giáo dục hàng đầu.', 1010, 102, 7000000, '962435f34614ade7b9a36b56bdcd48ca-2748982008607827737.jpg', 1, 'Đường Nguyễn Lương Bằng, Phường Phú Mỹ, Quận 7, Hồ Chí Minh', '10.70729,106.73198', '[{\"id\":\"size\",\"value\":\"50 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:25'),
(5390, 96116223, 2147483647, 'Cho thuê nhà DT: 4 x 16 đường số 12, Cát Lái, Q2', 'Cho thuê nhà nguyên căn mặt tiền đường số 12 xe hơi thông khu nguyển Thị Định, Q2. Nhà mới đẹp có 1PK, 1PN, bếp, toilet, sân trước và sân sau rộng rãi, vị trí trung tâm hành chính Tp. Thủ Đức, gần chợ Cây Xoài, bệnh viện Lê Văn Thịnh, đi về Q1 chỉ 10 phút. Khu an ninh, điện nước chính, giá: 6,5 triệu/th.', 1020, 119, 6500000, '4d6cf612dad56a11a4f7e8e070a3f740-2777630527999486537.jpg', 1, '', '10.77618,106.69653', '[{\"id\":\"size\",\"value\":\"60 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:25'),
(5391, 81226797, 2147483647, 'Phòg 1 trệt 1 lầu suốt dạg dãy như nhà nguyên căn', '- Phòng dang dãy 1 trệt, 1 lầu riêng biêt như nhà nguyên căn, tiện cho bà bầu, gia đình có con nhỏ thuê giá chỉ bẳng một phòng trọ, trong khi thuê một phòng trọ phải leo lên lầu cao.\n- Dãy ngoài măt tiền 2tr8-2tr9/căn trệt lầu. dãy trong hẻm nhỏ phía sau 2tr6-2tr7/căn trêt lầu\n- vị trí nằm gần chợ Hoàng Hoa thám, sân bay, đường rộng rãi, xe tải đậu trước nhà, có thể thuê vừa ở vừa buốn bán vì nằm ngay chợ tự phát.\n- xe cộ thoải mái, điện đồng hồ riêng\n- giờ giấc đi đứng như thuê nhà riêng biệt không gò bó như thuê pòng trọ\n- xe dể vào trong phòng riêng biệt không chung đụng\n- không giới hạn số lượng người ở', 1050, 112, 2400000, '8a865a847967d4fe362da43b135ad022-2699967209600194467.jpg', 0, 'Đường Hoàng Hoa Thám', '', '[{\"id\":\"size\",\"value\":\"30 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:25'),
