(5394, 89519701, 2147483647, 'CH CENTUM WEATH 3PN-2WC 8TR NHÀ MỚI FULL NT', 'Diện tích:\n- 54m2 - 68m2 giá thuê từ 6 triệu/ tháng.\n- 71m2 - 77m2 giá thuê từ 6.5 triệu/ tháng.\n- 82m2 - 85m2 giá thuê từ 7 triệu/ tháng.\n- 90m2 - 105m2 giá thuê từ 8 triệu/ tháng.\n\nTiện ích đầy đủ nổi bật:\n- Trung tâm thương mại, dịch vụ, và mua sắm.\n- Khu vui chơi trẻ em, nhà giữ trẻ.\n- Nhà thể dục thể thao đa năng, sân tennis, hồ bơi, và khu sân vườn thư giãn.\n- Gần chợ, ngân hàng, trường học.', 1010, 104, 8000000, '79e13353ca2df4da94573a29cc8848d9-2759879669020182769.jpg', 2, 'Đường Phan Chu Trinh', '10.80478,106.70346', '[{\"id\":\"size\",\"value\":\"90 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"3 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:26'),
