(5398, 96207247, 2147483647, 'NHÀ 2 LẦU TRONG KDC LUCKY DRAGON_ĐỖ XUÂN HỢP Q9', 'Cho thuê nhà dạng biệt thự trong KDC LUCKY DRAGON ngay Đỗ Xuân Hợp, Phường Phước Long B, Quận 9 ( TP. Thủ Đức )\n\n- DT : 4 X 16\n\n- Nhà 1 Trệt 2 Lầu. Xây dựng kiên cố thoáng mát, nhà mới tinh còn mùi sơn\n\n- Xe hơi đậu trước nhà không sợ bị bẻ gương, trộm cắp.\n\n- KDC an ninh, có bảo vệ 24/24.\n\n- Thiết kế : 4 phòng ngủ, 4 WC, phòng khách, 1 phòng ăn, 1 bếp. Sân trước + Sân sau.\n\n- Nhà sẵn máy lạnh ở tất cả các phòng\n\n- Mặt tiền rộng rãi thoáng mát 10m\n\n- Thích hợp ở và làm văn phòng.\n\n- Tiện ích nội khu đầy đủ không thiếu thứ gì gồm Chợ, cửa hàng tiện lợi, quán CF, quán ăn, nhà hàng,.......bán kính chưa tới 100m.\n\n- Nằm cách Đỗ Xuân Hợp 50m, thuận tiện di chuyển đến các quận lân cận\n\n———•———?PHƯỜNG HOMY ? ———•———\n\n? HOMY GROUP chuyên bất động sản uy tín khu vực Thủ Đức ?\n\n? Nhận ký gửi cho thuê nhà, chung cư, đất, mặt bằng, kho xưởng...( Có sẵn khách xem nhà liền ).\n?️ Nhận tìm nhà theo yêu cầu hoàn toàn miễn phí.\n? Hỗ trợ khách xem nhà 24/24.\n\nTham khảo thêm nhiều nhà tại đây nhé.\n↙️ ☎️ (Zalo) ↩️', 1020, 119, 24000000, '67907bfa776d23c9c6c6b9f987813db6-2778003080436375867.jpg', 4, '', '10.81635,106.77439', '[{\"id\":\"size\",\"value\":\"64 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"4 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:27'),
