(5400, 88387767, 2147483647, 'Căn hộ mi ni giá rẻ 23 -25 thân nhân trung', 'Khu căn hộ mini được trang bị nội thất cao cấp nằm tại khu vực an ninh, thuận tiện đi lại, nhiều dịch vụ xung quanh. Căn hộ có diện tích từ 25-35 m2, có gác lửng, trang bị đủ tủ quần áo, tủ lạnh, TV, máy giặt, nước nóng lạnh truyền hình cáp, internet cáp quang. Khu căn hộ nằm trong khuôn viên biệt thự yên tĩnh, an ninh, thông thoáng, bảo vệ 24/24, bãi để xe rộng rãi, vệ sinh sạch sẽ. Khu vực không bao giờ ngập nước ,cách đường cộng hoà 50 m .Cách ETOW 100m .sân bay 1000m . 3siêu thị lớn đi 5 phút , gần trường đại học hàng không , makengtinh , trường thực phẩm .. và nhiều trường học- chợ-cữa hàng tiện lợi-quán ăn và các dịch vụ thiết yếu khác.Giá phòng thuê có thể thoả thuận theo diện tích -ví trí -thời gian thuê-yêu cầu nội thất.Giá thuê từ 4tr500 đến 6tr500 .Liên hệ chính chủ- có khuyến mãi sau dịch covid-19 - thuê nhanh để có giá tốt', 1010, 112, 4500000, 'eb774201755f3e764f866eb0ab26c7a0-2740316404174654573.jpg', 1, 'Đường Thân Nhân Trung', '10.80431,106.64257', '[{\"id\":\"size\",\"value\":\"30 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:28'),
(5401, 96207238, 2147483647, 'NHƯỢNG CHUNG CƯ GIÁ RẺ Q1', '[NHƯỢNG PHÒNG]\nCuối 6 đầu tháng 7 mình cần nhượng lại nhà\nĐịa chỉ: Chung cư 212 Nguyễn Trãi Lô B. (Nằm ngay bùng binh Nguyễn Trãi - Cống Quỳnh)\n- Nhà ở căn góc có 2 phòng ngủ, 1 phòng khách rộng có bếp riêng, 1 Wc. 2 phòng đều có ban công (Ban công nối liền hình chữ L). Nhà căn góc 2 mặt nên có rất nhiều cửa sổ và ánh sáng. \n- Điện nước giá dân, gửi xe ngay dưới toàn nhà. Khu dân cư nên có rất nhiều đồ ăn uống (rất nhiều quán ăn ngon lại rẻ nha)\n- Giá phòng 7tr-7tr5. Cọc 1 tháng đóng tiền nhà 1 tháng\nChi tiết mọi người liên hệ Dương sẽ hỗ trợ xem nhà nha \nCảm ơn mọi người đã xem bài', 1010, 96, 7000000, '98609e353a912f6de49821fbec429b2b-2778004927933552420.jpg', 1, '', '10.7679,106.68886', '[{\"id\":\"size\",\"value\":\"54 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:28'),
(5402, 96207237, 2147483647, 'CC 2PN-2WC/Apartment for rent-2br-Saigon Gateway', 'CHO THUÊ GÍA TỐT FULL NỘI THẤT SAIGON GATEWAY DỌN VÀO Ở NGAY\nDT: 66m2, 2PN/2WC: đầy đủ nội thất\nView:Vinhome Grand Park\nTầng cao thoáng mát\nNội thất gồm có:\nBếp điện từ, tủ lạnh, bàn ghế, rèm, tủ quần áo, giường, 2 máy lạnh, tivi, máy nước nóng...\nVị trí: mặt tiền đường Xa lộ Hà Nội, Quận 9, TP.HCM. Dễ dàng vào trung tâm thành phố với 2 tuyến giao thông thuận tiện Xa lộ Hà Nội, 5 phút đi làng Đại học, 10 phút đi Khu Công Nghệ cao, 500m đến Ngã 4 Thủ Đức.\nTiện ích nội khu : Hồ bơi, công viên trẻ em, cửa hàng tiện lợi 24/7 café, ngân hàng, quán ăn, spa,...\nĐc: 702 Xa Lộ Hà Nội P.Hiệp Phú Q9\nLiên hệ: Hằng \n\nModern furnished apartment at 21st floor with natural light and wind for 2bedrooms, 2WC at Saigon Gateway building in Thu Duc City (District 9)-Ho Chi Minh City, located in center area to travel easily to District 1 (20 mins), District 2 (10 mins), Saigon Hi-tech Park (5 mins), Binh Duong (15mins)..\nFacility: swimming pool, park, convenience shops, bank, restaurant..\nAddress: 702 Xa Lo Ha Noi, Hiep Phu Ward, Thu Duc City, Ho Chi Minh City\nContact direct landlord: Ms Hang', 1010, 119, 10000000, '9c5c13b95dcd659f7d795e4fda58c405-2778004860070957009.jpg', 2, '', '10.85395,106.78117', '[{\"id\":\"size\",\"value\":\"66 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:28'),
