(5418, 95801028, 2147483647, 'SANG NHƯỢNG STUDIO ÁO CƯỚI', 'Chính Chủ Sang Mặt Bằng Kinh Doanh Ngay Mặt Tiền Quận 10\n\n- Do mở rộng kinh doanh nên mình cần sang nhượng lại mặt bằng hiện đang kinh doanh rất tốt của mình\n- Mặt bằng là nhà nguyên căn đã sửa chữa đầy đủ trang thiết bị, vào là kinh doanh ngay gồm 1 trệt và 2 lầu có 3 phòng. Tiệm đã được mình thuê thiết kế tâm huyết làm toàn bộ từ sơn sữa, trần thạch cao, sàn gỗ full, hệ thống điện và đèn rọi âm trần, đèn chùm....chỉ mới sử dụng hơn 1 năm, tất cả còn rất mới các bạn đến xem đảm bảo sẽ thích ngay\nThích hợp các ngành nghề như spa, studio, shop quần áo, thẩm mỹ viện.....\n- Vị trí ngay tuyến đường đông đúc sầm uất xung quanh là các hộ kinh doanh lượng khách vãng lai cực tốt\nMình sang để lại một số nội thất trang thiết bị kinh doanh\n+ 2 bộ sofa tiếp khách, bao gồm thảm trang trí\n+ 1 quầy lễ tân , 2 bộ rèm phòng thử váy\n+ 2 máy lạnh ,Background manocanh\n+ Toàn bộ sào treo\n\nDiện tích: 4m5 x 22m\nGiá thuê: 35tr/ tháng\nGiá sang: 150 triệu\nGiá thương lượng cho khách thiện chí mau lẹ\n\nĐịa Chỉ: 32 Bắc Hải p.6 Q.Tân Bình\nLiên hệ: Mr Thái ***', 1030, 112, 35000000, '80b664f1f5b35fdd93db6aec473b185b-2776217673490247791.jpg', 0, '', '10.78247,106.66045', '[{\"id\":\"size\",\"value\":\"200 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:32'),
(5419, 96136084, 2147483647, 'Cho thuê nguyên căn nhà mặt tiền Nguyễn Thái Bình', 'Nhà mặt tiền Nguyễn Thái Bình phường 12 Tân Bình.\nNgang 5 dài 14, 1 trệt, 2 lầu. Khu vực sầm uất nhất đường NTB.\nNhà trống sạch đẹp. Nội thất cao cấp.\nSát trường học cấp 2,3,trường cao đẳng lý tự trọng.\nGiá thuê rẻ nhất khu vực', 1020, 112, 45000000, 'ef1f6e3bdaa7299aebd704194a36f528-2777695309674521691.jpg', 4, '', '10.79709,106.65357', '[{\"id\":\"size\",\"value\":\"75 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"5 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:33'),
