(5421, 96207196, 2147483647, 'cho thuê phòng trọ nội thất cao cấp p Thảo Điền Q2', 'Cho thuê phòng trọ trang bị mọi nội thất  cao cấp ở Thảo Điền, Quận 2 giá 4 triệu/th.\n\nĐầy đủ nội thất và tiện nghi như:\n1/ Giường, nệm cao cấp dunlopilo, ga trải giường (2 cái để thay).\n2/ Tủ quần áo lớn big size để được nhiều đồ,\n3/ Bàn làm việc.\n4/ Bàn ăn.\n5/ Ghế làm việc 02 cái (có thể cung cấp thêm nếu khách có nhu cầu).\n6/ Tủ lạnh riêng.\n7/ Bếp nấu riêng.\n8/ Tủ bếp dưới, + tủ bếp trên, bồn rửa chén, kệ treo inox để bát chán đũa.\nPhòng tắm có:\n1/ Máy nước nóng gián tiếp.\n2/ Lavabo, sen tắm, gương treo, tủ và kệ treo đựng đồ thông minh.\n\nPhòng có cửa sổ có cửa lưới chống muỗi rộng đón mặt trời vào buổi sáng sớm, không gian yên tĩnh và thoáng mát nhiều ánh sáng.\nĐược cấp wifi tốc độ cao miễn phí.\nCó khu đậu xe miễn phí thoải mái, giờ giấc tự do, không chung chủ....\n\nVị trí:\nTrung tâm Thảo Điền, cách cầu Sài Gòn 400 m.\nGần khu tropic garden Thảo Điền.\n\nCách trung tâm thành phố 7 phút lái xe.\nLiên hệ xem phòng gọi hoặc zalo:', 1050, 119, 4000000, 'ec0f5f7829a4f8a926a83efa831d34e5-2778003680654033305.jpg', 0, '', '10.77618,106.69653', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:33'),
