(5428, 78652527, 2147483647, 'Phòng đối diện Chợ Bến Thành, có phòng lớn 40m2', '- phòng diện tích: 9m2-15m2 (phòng trọ đơn) - 40m2 ( dạng căn hộ 2 phòng ngủ,phòng khách, bếp), giá cả bình dân phù hợp dân văn phòng, sinh viên, lao động. Phòng riêng biệt\n- vị trí năm đối diện chợ bến thành, huận tiện vừa ở vừa kinh doanh online\n- giờ giấc tự do 24/24, không chung chủ\n- không giới hạn người ở\n- sạch sẽ, camera an ninh nên tiện ai muốn ở lâu dài\n- ưu tiên người có công ăn chuyện làm, ở sạch sẽ', 1050, 96, 1600000, '44ffe9fdf175a4f413e52dcebb3eaf18-2690241195420401060.jpg', 0, 'phó đức chinh', '', '[{\"id\":\"size\",\"value\":\"20 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:35'),
(5429, 95775527, 2147483647, 'CHÍNH CHỦ MẶT BẰNG QUẬN 10 MB NGUYỄN TRI PHƯƠNG', 'NGÃ BA MẶT TIỀN NGUYỄN TRI PHƯƠNG KINH DOANH QUẬN 10 \nGiá 14 triệu / mặt bằng   - 18 triệu cả căn\n\nCHÍNH CHỦ CHO THUÊ MẶT TIỀN NGÔ QUYỀN 136B, P5, Q.10, HCM\n \n- Diện tích 3.2m x 13m, 1 trệt, 1 lửng 1 lầu - 3 phòng ngủ - 3 toilet\n\n- Vị trí đẹp ngay góc ngã 3,  hai luồng giao thông. Buôn bán tốt, khu sầm uất  QUẬN 10, tiện làm văn phòng, công ty, nhà ở. Gần trường học, chợ  + khu ăn uống mua sắm nhộn nhịp \n- ĐOẠN ĐƯỜNG XUNG\n- KHÔNG KÉN NGÀNH NGHỀ\n- Giá thuê 18 triệu. Ưu tiên cho thuê lâu dài. Nhà trống nhận nhà ngay. \n\n- Đặt cọc 2-3 tháng và đóng tiền nhà 1 tháng.\n- Có phòng ngủ, phòng toilet RIÊNG mỗi tầng.      \n-  CÓ VỈA HÈ. \n - Mặt tiền rộng 40m, có lề đường thông thoáng. \n- phòng tắm x3 , phòng ngủ x3\n- 1 trệt 1 lửng 1 lầu \nThuê mặt bằng chỉ 14 triệu, thuê cả căn 18 triệu/ tháng.\nLiên hệ:  : gọi điện\nThank ?', 1030, 105, 14000000, '0b2e9e2e8e7e68a3c3ee4bd0d7bed78d-2776069556344163720.jpg', 0, '', '10.76389,106.66799', '[{\"id\":\"size\",\"value\":\"45 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:35'),
(5430, 90315022, 2147483647, 'CĂN HỘ FLORA 2PN,2WC, GIÁ CHỈ 7TR5', 'CĂN HỘ 2PN,2WC NHÀ TRỐNG ĐÃ LẮP RÈM CỬA, VÀO Ở NGAY. GIÁ TỐT \n\nLIÊN HỆ COI NHÀ 24/7.\n\nNhà cực đẹp, mát mẻ.', 1010, 119, 7500000, '340ce5ffa7f3c1ab58537e8ded79552d-2749524339852252457.jpg', 2, 'Đường Phạm Văn Đồng', '10.8229,106.70366', '[{\"id\":\"size\",\"value\":\"72 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:36'),
(5431, 96207165, 2147483647, 'MBKD view đẹp tại chung cư 40E tôn thất thiệp', '\"❤️ Địa chỉ: 40E2/ 42 Tôn Thất Thiệp, Bến Nghé, Q.1 (ngay các trung tâm mua sắm lớn Takashimaya, Sunwah, Bitexco)\n❤️Diện tích: 4x15m. thêm gác 100m2 diện tích sàn sử dụng, bao gồm 1 gác riêng biệt (có thể share lại cho shop khác nếu muốn) \n??Vị trí đẹp nhất nhì chung cư, nằm ở mặt trước nên traffic rất cao và độ nhận diện cao. \n??Mặt tiền sáng sủa và tràn ngập ánh sáng mặt trời ??Dọn vào là bán luôn, cam đoan không cần sửa chữa nhiều \n? Giá thuê: 24,9 triệu/ tháng (cọc 2 tháng - kí hđ 3 năm) \n? Giá sang (tuỳ khách thuê - nếu không muốn sang thì mình sẽ để lại mặt bằng trống suốt ạ): 150 triệu - Để lại toàn bộ nội thất, tủ kệ, 1 máy lạnh trung tâm, toàn bộ hệ thống đèn, hệ thống camera, manocanh, sofa, dàn tủ kho) chỉ cần dọn vào là kinh doanh ngay.\"', 1030, 96, 25000000, 'd1150f12a3e50b07e702f3242db42ea6-2778004495735492561.jpg', 0, '', '10.77225,106.70287', '[{\"id\":\"size\",\"value\":\"100 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:36'),
(5432, 96096111, 2147483647, 'phòng nt đầy đủ sang xịn mịn ngay TT SG', '?CHO THUÊ PHÒNG TRỌ FULL NỘI THẤT GIÁ SINH VIÊN\n☑☑ Đặc điểm: hẻm 12m, khu yên tỉnh, thoáng mát, đủ loại phòng phù hợp với mọi người.\n☑☑ Thuận tiện đi chuyển sang các quận trung tâm 1,3,5,7,10,4,6, Tân Phú, Tân bình \n☑☑ Tiện ích :  Bán kính 500m là chợ, cửa hàng tiện lợi, ngân hàng, nhà thuốc, các cửa hàng ăn uống, trường học,....\n☑☑ Cách Đại học văn hiến 5phút đi xe, cách bigC 500m, mất 5 phút đi xe đến bệnh viện tân Phú…\n☑☑ Tiện nghi : Nhà ra vào bằng khoá thẻ từ , giờ giấc tự do , không chung chủ , vệ sinh 2-3lần/tuần , có hầm xe, có thang máy, camera an ninh 24/24, có sân phơi , máy giặt, có ban công rộng rãi thoáng mát phù hợp cho gia đình có con nhỏ.\n☑☑ Cho nuôi pet\n☑☑ Nội thất : máy lạnh, kệ bếp , giường , nệm tủ quần áo, tắm nước nóng NLMT , tủ lạnh, rèm cửa, máy giặt….\n☑☑ Giá :  4tr5/phòng\n☑☑ Điện : 3,8k\n☑☑ Nước : 100k/người\nLiên hệ Vân', 1050, 98, 4500000, 'ddc130090f8428a8b192dbdb65555062-2777513157018682762.jpg', 0, '', '10.78282,106.68702', '[{\"id\":\"size\",\"value\":\"30 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:36'),
(5433, 96207163, 2147483647, 'Cho thuê nhà Mặt Tiền đường Trần Phú P1 Quận 5', 'Cho thuê nhà nguyên căn nhà mặt tiền đường Trần Phú Phường 1 Quận 5. \nDiện tích: 4×14m2 . Nhà 1trệt 1 lửng. 2lầu. Gồm mặt bằng tầng trệt rộng, Bếp, 4phòng ngủ, 3WC. Nhà mới đẹp sạch sẽ kinh doanh mọi ngành nghề. Giá: 25triệu/tháng còn thương lượng. \nLiên hệ xem nhà: A Tuấn', 1020, 100, 25000000, 'b755583442775f3413f902339b6a137b-2778003516543559589.jpg', 3, '', '10.75529,106.68103', '[{\"id\":\"size\",\"value\":\"64 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"4 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:36'),
