(5438, 87845210, 2147483647, 'Phòng Phạm Văn Đồg cắt Tô Ngọc Vân dạg dãy,có gác', '- phòng ngay Phạm văn đồng giao Tô ngọc vân, tiện ra quận 2, bình thạnh, quận 1, phú nhuận. trung tâm quận thủ đức\n- gần chợ Tam Hà, Bệnh viện quận thủ đức\n- phòng xây dạng dãy, không phai leo lên lầu cao lại có gác, xe đẩy được vào phòng nên an ninh, không trầy xe. phù hợp gia đình, người lớn tuỏi, chuẩn bị kế hoạch sinh em bé\n- giá thuê 1tr-1tr3/phòng rất phải chăng và rất mềm rất phù hợp trong mùa dịch. không tăng giá\n- giờ tự do, không chung chủ\n- wìi đầy đủ\n- không giới hạn lượng người ở, bạn bè tới chơi có thể ở lại qua đêm\n- ưu tiên thuê lâu dài, sinh viên, người có việc làm ổn định', 1050, 114, 1100000, 'ae9467fa65e0b10b132383eeb4d5220d-2732878860714328746.jpg', 0, 'Đường Tô Ngọc Vân', '10.86162,106.74477', '[{\"id\":\"size\",\"value\":\"20 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:38'),
(5439, 95071737, 2147483647, 'Nhà 1T3L 4*15 6PN4WC Liên Phường', '- Cho thuê nhà 1 trệt 3 lầu hẻm xe tải đường Liên Phường,ra mặt tiền đường 30m, gần Chung cư The Eastern, Vòng xoay Liên Phường\n\n- Diện tích 4x15 gồm 6pn 4wc, bếp, sân để xe. Phù hợp làm vp cty, ở\n\n- Giá thuê 16tr/ tháng còn thương lượng cho khách thiện chí\nAnh chị xem nhà lh e Dũng', 1020, 104, 16000000, '3c61bed4e2dafa571bb2548d8a0d883a-2772918210577403926.jpg', 4, '', '10.79352,106.80008', '[{\"id\":\"size\",\"value\":\"60 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"6 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:38'),
(5440, 95849272, 2147483647, 'Cho thuê CHDV trung tâm Quận 1 sát cạnh Bùi Viện', '- Sát ngay phố đi bộ Bùi Viện\n\n- Thuận tiện đi lại giữa các quận\n\n- Gần bến xe công viên 23/9\n\n- Gần các trường đại học Văn Lang, đại học Sài Gòn, đại học Kinh tế\n\n- Có sẵn nội thất\n\n- Nuôi thú cưng thoải mái\n\n- Thang máy tiện ích\n\n- Camera an ninh\n\n- Chỗ giữ xe rộng rãi\n\nNgoài ra còn có các phòng giá từ 4tr5 - 7tr8\n\nCall qua sđt hoặc Zalo để được tư vấn chi tiết hơn', 1010, 96, 5000000, '2a98ada67f74d5714972ab18c2ced383-2777657989435646647.jpg', 1, '', '10.76838,106.69256', '[{\"id\":\"size\",\"value\":\"30 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:38'),
(5441, 80425328, 2147483647, 'Phòng trọ mới xây KDC Nam Long Q9', 'Cho thuê phòng cao cấp mới xây có tủ lạnh, máy giặt riêng ngay KDC Nam Long Q9. Giá thuê 3.5 triệu/tháng\n?Thiết bị vệ sinh cao cấp: bồn cầu 1 khối, lavabo cao cấp, gương soi, móc treo quần áo, kệ inox cao cấp đựng dầu gội sữa tắm, hộp đựng giấy vệ sinh, vòi xịt, thùng đựng rác...\n? Mặt bếp lát đá, vòi rửa chén cao cấp, khay inox đựng chén đĩa 2 tầng\n?Quạt\n?Nước nóng NLMT\n?Ngạch cửa lát đá cao cấp\n========================\n⚡️Phòng rộng, sạch đẹp, trần cao 4.5 m thoáng mát, có gác, gác đứng thẳng người được. Gác lát gạch sạch sẽ, kiên cố\n⚡️Có chỗ nấu ăn riêng, toilet trong phòng\n⚡️Nhà để xe rộng rãi, thoáng, không phải đưa xe vào phòng \n⚡️Có cửa sổ phòng, cửa sổ toilet, cửa sổ chỗ bếp nên rất thoáng mát. Cửa cao cấp, kính cường lực an toàn, sang trọng\n⚡️Wifi internet tốc độ cao 200MB\n⚡️Camera an ninh\n⚡️Cửa vân tay, không chung chủ, giờ giấc tự do \n⚡️ Diện tích: 30 m2, có thể ở 3-4 người\n====================\n?Địa chỉ: 20 đường D9, KDC Nam Long Quận 9. KDC cao cấp, trí thức', 1050, 119, 3500000, '7b6dd91c1d09b40e8fd1b5150e2c42c0-2704742634331551677.jpg', 0, '', '10.81345,106.62593', '[{\"id\":\"size\",\"value\":\"28 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:38');
