(5442, 81341123, 2147483647, 'Phòng trọ hẽm xe hơi ful nội thất', 'Phòng mới xây hẽm xe tải gần cầu Chữ Y\n* Tại : 451/31b Phạm Thế Hiển , P3 , Q8\nCách cầu Chữ Y 800m , gần chợ rạch ông, trường ĐH CNSG , Bệnh Viện Quận 8, . Di chuyển chỉ 5 phút qua quận 1,4,5,7\n* Hẽm xe tải , ko ngập nước , nhà mới xây  , ra vào bằng khoá vân tay , giờ giấc tự do , ko chung chủ, để xe miễn phí trong nhà , camera an ninh 24/24 , vệ sinh 1-2 lần/tuần , có máy giặc , có chổ phơi đồ trên sân thượng \n* Tiện nghi : phòng có tolet riêng , có cửa sổ , máy lạnh inverter , tủ quần áo , nệm cao su, máy tắm nước nóng năng lượng mặt trời , kệ bếp (lắp theo yêu cầu)\n• Giá : 3tr-4tr\n* Điện :3.8\n* Nước : 100k/người\n* LH : A Trung ( xem nhà gọi trước 15p)', 1050, 103, 3200000, '5039b7a42d01bd750f0209fb63414d31-2736651918039404526.jpg', 0, '', '10.73654,106.64894', '[{\"id\":\"size\",\"value\":\"18 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:39'),
