(5455, 96207073, 2147483647, 'Chung cư 2PN mới gần Suối tiên chính chủ cho thuê', 'Mình chính chủ cần cho thuê chung cư diện tích 56m2\nCó Clip mình quay toàn bộ nhà.\nNhà mới, chưa ở còn trống như hình, Đã có Rèm cửa\nCó hồ bơi, khu vui chơi trẻ em, siêu thị\nKhách cần lắp máy lạnh thì mình sẽ lắp sẵn thuận tiện cho khách thuê.\nChung cư mới, nhiều tiện ích, vị trí thuận tiện\nNgay đường vào khu Đại học quốc gia, đại học An ninh\nĐối diện suối tiên, gần bến xem miền đông mới.\n\nGiá thuê ưu đãi chỉ 5 triệu đồng / 1 tháng. Thỏa thuận hợp đồng\nLắp sẵn máy lạnh thì giá thuê 5,5tr/ 1 tháng.\nBạn nào có nhu cầu thì Alo/Zalo mình nhé\nCảm ơn các bạn đã xem tin.', 1010, 11, 5000000, '56ce7d65198fd7c8e6a5398ab910cf5f-2778003075312499979.jpg', 1, '', '10.774499,106.70607', '[{\"id\":\"size\",\"value\":\"56 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:42'),
