(5457, 96207067, 2147483647, 'Phòng studio mới xây gần Vincom Gò Vấp', '? MEGAS KHAI TRƯƠNG ĐỘC QUYỀN PHÒNG TRỌ MỚI XÂY \nĐịa chỉ: Trần Bá Giao,P5, Gò Vấp\n—————————————————\n\nG.i.á chỉ từ 3.900.000- 4.300.000\n\n?Vị trí: Cách ĐH Công Nghiệp 4 và ĐH Văn Lang 3 chỉ 5 phút. Giáp Phạm Văn Đồng, Phan Văn Trị, Nguyễn Văn Nghi, Nguyễn Văn Bảo, Huỳnh Khương An, Nguyễn Thái Sơn, Dương Quảng Hàm. Thuận tiện qua Bình Thạnh chỉ 3 phút\n\n❌❌Đặt biệt FREE tiền giữ XE\n\n✅ Nội thất máy lạnh, máy quạt, tủ bếp, máy nước nóng lạnh, máy giặt chung\n\n- Phòng ở được 2 -3 người', 1050, 110, 3900000, '701326d81bfae9cab0bfdfb7461edd8a-2778003297243109666.jpg', 0, '', '10.83207,106.69007', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:43'),
