(5459, 95793856, 2147483647, 'CHUYÊN CHO THUÊ CH DLUSSO-PRECIA GIÁ THIỆN CHÍ', 'HIỆN TẠI BÊN EM CÓ NHỮNG DỰ ÁN PRECIA - DLUSSO GIÁ TỐT , NỘI THẤT SANG ĐẸP VÀ ĐỦ LOẠI HÌNH CĂN HỘ - HỖ TRỢ TƯ VẤN 24/7.\n\n- Căn hộ 1PN - 1WC: Diện tích 49-52m2 - Giá từ 7 triệu có nội thất đầy đủ\n- Căn hộ 2PN - 2WC: Diện tích 68-75m2 - Giá từ 10 triệu có nội thất đầy đủ\n- Căn hộ 3PN - 3WC: Diện tích 97 - 104.2m2 - Giá từ 12 triệu có nội thất đầy đủ\n\nNội thất bàn giao: Máy lạnh, máy nước nóng, cửa gỗ lõi thép chống cháy, kệ bếp trên dưới, chậu rửa. Ưng là dọn vào ở ngay không cần đemgì nhiều.\n\nNằm trong khu chung cư cao cấp hiện đại, sang trọng và đẳng cấp, nhà mới, đẹp.\n- Hồ bơi đẹp, công viên ven sông, BBQ ven sông mát mẻ. View thoáng mát, môi trường không gian xanh trong lành yên tĩnh, an ninh 24/24 có camera, nhiều tiện ích được miễn phí.\n- Tầm nhìn ven sông yên tĩnh. Với vị trí ngay  nằm ngay “trái tim” Quận 2, chỉ cách “nửa bước chân” để đến KĐT mới Thủ Thiêm, Cao tốc Long Thành - Dầu Giây, Quận 1, Quận 7, thừa hưởng tiện ích từ các dự án, trung tâm thương mại, văn phòng, trường học đẳng cấp quốc tế, bệnh viện,...\n\nBên em cam kết uy tín\n- Hỗ trợ làm giấy tờ\n- Tư vấn vay vốn', 1010, 119, 10000000, '2ae3259ce2112432f79e8dbe6da6a3a6-2776198912222515647.jpg', 2, 'Đường Nguyễn Thị Định, Phường An Phú, Quận 2, Hồ Chí Minh', '10.79161,106.75348', '[{\"id\":\"size\",\"value\":\"75 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"3 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:43'),
