(5461, 88681492, 2147483647, 'THUÊ CH RICHMOND CITY 2PN FULL NT 11TR', '- Căn 2 phòng ngủ 70m2\n(G2, G3, G6, G14, G17, G18, R2, R3, R6, R2, R3, R6, R14, R17, R18).\n\n- Vị trí: Đối diện Vincom Nguyễn Xí, di chuyển về quận 1 chỉ 10 phút.\n- Hỗ trợ vay 70% tổng giá trị căn hộ và mức chiết khấu lên đến 18% nếu thanh toán vượt tiến độ.\n- Thanh toán theo tiến độ xây dựng.\n\nQuy mô căn hộ Richmond City: 3 block, cao 25 tầng, 1 tầng hầm thông 3 block. Bao gồm: Khối căn hộ, officetel, shophouse, TTTM.\n\nTiện ích: Hồ bơi tràn trên cao, công viên nội khu, công viên trên cao, sân vườn đường dạo, trung tâm thương mại, gym, spa...\n\nTọa lạc ngay ven sông mặt tiền đường Nguyễn Xí, Bình Thạnh. Căn hộ Richmond City với 3 mặt view sông. Gần đường Phạm Văn Đồng, sân bay Tân Sơn Nhất...\n\n* Richmond City là thành công của Hưng Thịnh tiếp nối những dự án: Lavita Charm, Lavita Garden, 9 View,...\nThông tin pháp lý: Đã giao nhà.', 1010, 109, 7500000, '483_overview_1.jpg', 2, 'Số 207 Đường Nguyễn Xí', '10.81646,106.7062', '[{\"id\":\"size\",\"value\":\"70 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:43'),
(5462, 96207049, 2147483647, '??Căn hộ studio BAN CÔNG full nội thất Bình Thạnh?', 'Chính chủ cho thuê CHDV ban công cửa sổ siêu thoáng tại 18 Tăng Bạt Hổ, p11, Bình Thạnh\n? Diện tích : 25m2 giá 6.700.000 (cuối tháng trống)\n                     30m2 giá 7.500.000 (cuối tháng trống)\n\n- Điện 4k/kwh\n- Nước 100k/người\n- Phí dịch vụ 150k/phòng\n- XE FREE.\n\n?Có chỗ giữ xe rộng rãi , khoá vân tay cực kỳ an ninh\n? Nhà mới, có thang máy\n?Giờ giấc tự do, không chung chủ\n\n☎️Liên hệ xem phòng ngay: *** (Sdt/Zalo)', 1010, 109, 6700000, '7adddeb80313f704df6dd02bf880b3df-2778003218014860687.jpg', 1, '', '10.7964735,106.70635', '[{\"id\":\"size\",\"value\":\"30 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:43'),
