(5466, 96207023, 2147483647, 'sân thượng lầu 6 MT Lý tự trọng ốp kính, chỉ 15tr', 'Cho thuê rooftop lầu 6 Mặt tiền lý tự trọng, bến thành q1\n Tầng 6 (sân thượng) là 15.000.000 4 mặt là kính view toàn cảnh trung tâm Q1.\nGiá thuê trên bao gồm tất cả phí quản lý, bảo vệ 24/7, lễ tân, quản lý tòa nhà, bảo trì thang máy, tòa nhà, nước... \nVị trí địa lý: Là trung tâm của HCM, khu vực đắc địa cho mọi hoạt động kinh doanh.\nThuận lợi đi lại các quận trung tâm.\nXem nhà LH trước 1 tiếng', 1030, 96, 15000000, 'a454355fabd48cea370397d9b74f1585-2778003199093806884.jpg', 0, '', '10.77346,106.69635', '[{\"id\":\"size\",\"value\":\"65 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:44'),
(5467, 96207017, 2147483647, 'Mặt bằng kinh doanh đường Cách Mạng Tháng 8', 'Mặt bằn kinh doanh đường Cách Mạng Tháng 8, Quận 3\nDiện tích: 4*16m\nMặt bằng trống suốt, mới sữa chữa lại, đường 2 chiều , rộng, gần toà nhà và ngân hàng, khu vă phòng, tuyến đường liên quận, kinh doanh dầm uất, có bãi giữ xe oto..\nThích hợp : coffee, showrrom, cửa hàng thời trang, spa...\nGiá mềm nhất thị trường hiện tại', 1030, 98, 35000000, 'acb008cc86753854996f7facde168fc6-2778002404533541154.jpg', 0, '', '10.77457,106.68674', '[{\"id\":\"size\",\"value\":\"62 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:45'),
(5468, 94743243, 2147483647, 'Căn hộ full dịch vụ dọn vào ở liền', 'Mình có căn hộ dịch vụ cho thuê giá tốt tại trung tâm quận 1.\n- Ngay mặt tiền Nguyễn Thị Minh Khai, gần các quán xá, cà phê, cửa hàng tiện lợi.\n- Gần công viên, bờ kênh mát mẻ để tập thể dục.\n- Gần Đài Truyền Hình, sát bên nhà sách Hải An.\n- Gần ngay các tòa nhà văn phòng lớn, tuyến đường Tôn Đức Thắng, Lê Duẩn, Nguyễn Bỉnh Khiêm.\n- Tổ hợp nhà sạch sẽ, tiện dụng.\n- Bố trí các phòng hợp lý, thông thoáng gió.\n* Tiện nghi đầy đủ:\n+ Giường, bộ nệm + drap, gối mền ấm áp.\n+ Tivi đa dạng kênh truyền hình.\n+ Máy lạnh, tủ lạnh Inverter tiết kiệm điện.\n+ Bộ bàn ghế lớn đa năng, dùng cho nhiều mục đích: Ngồi ăn, học, làm việc.\n+ Tủ quần áo rộng rãi, tủ bếp sạch sẽ.\n+ Toilet rộng rãi, riêng biệt, nước nóng lạnh năng lượng mặt trời tiết kiệm điện.\n- Có thang máy di chuyển nhanh chóng.\n- Hệ thống báo cháy an toàn khắp nhà.\n- Camera các tầng, đảm bảo an ninh tuyệt đối.\n- Ra vào tòa nhà bằng hệ thống vân tay hiện đại, an toàn tuyệt đối.\n- Bao gồm dọn dẹp vệ sinh khu vực chung và phòng riêng hàng tuần.\n- Có khu giặt sấy khô ngay không phụ thuộc thời tiết.\n- Có cửa sổ ánh sáng tự nhiên tràn ngập tốt cho sức khỏe.\n- Giờ giấc tự do.\n- Môi trường văn minh, lịch sự, an ninh tuyệt đối, vị trí cực thuận tiện để di chuyển về các quận khác.\n* Miễn phí:\n+ Sử dụng wifi, cáp truyền hình.\n+ Sử dụng máy giặt, máy sấy.\n+ Chỗ để xe rộng rãi, an toàn và hoàn toàn miễn phí.\n* Diện tích: 28m2.\n* Có ưu đãi cho khách thuê dài hạn.\n* Có cho thuê ngắn hạn.\n- Đc: 2A/4 Nguyễn Thị Minh Khai, Quận 1.\nLiên hệ Ms. Thảo.', 1010, 96, 5500000, 'f0f23fa56386a1412ad6648a1ae37cd3-2771469812744348930.jpg', 1, '', '10.78733,106.7022', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"1 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:45'),
(5469, 95811393, 2147483647, 'Cho thuê văn phòng MẶT TIỀN Nguyễn Công Trứ 80m2', '- Cho thuê văn phòng MẶT TIỀN Nguyễn Công Trứ, p. Nguyễn Thái Bình, quận 1.\n- Vị trí: Nằm ngay trung tâm, thuận tiện di chuyển đến các quận lân cận.. \n- Địa điểm làm việc lý tưởng.\n- Nhiều tiện ích và dịch vụ tại toà nhà vô cùng tốt, an ninh..\n- Đặt biệt giá rẻ 20tr/tháng, sàn 80m2.', 1030, 96, 20000000, '13974ced983ec10d077afa69f9ee592c-2776243396249907518.jpg', 0, '', '10.76883,106.69931', '[{\"id\":\"size\",\"value\":\"80 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:45'),
