(5471, 91174806, 2147483647, 'Nhà đẹp sạch sẽ thoáng mát trung tâm giá rẻ', 'Cho thuê nhà quận 11 khu trung tâm nhà đẹp giá rẻ sạch sẽ vào ở ngay \n- Dt 3x7 1 lầu giá 3tr bình thới \n-  Dt 4x17 4 lầu 5 phòng giá 20tr lạc long quân \n- Dt 4x8 1 lầu 2 phòng giá 5tr lạc long quân \n-Dt 4x12 3 phòng giá 8 tr lac long quân \nXem nhà trực tiếp đến 341 lạc long quân f5 q11', 1020, 106, 3000000, 'f0aa7a0b46120446e8b9bd9572d0ef9f-2753539073409822768.jpg', 2, '', '', '[{\"id\":\"size\",\"value\":\"22 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"2 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:45'),
