(5474, 90180142, 2147483647, 'OPAL BOULEVARD 3PN -2WC 8TR FULL NT BPQL', 'Mình chính chủ mới nhận căn hộ Opal Boulevard gần phạm văn đồng cần cho thuê.\n\n- Diện tích căn hộ cần cho thuê: 85m2.\n- Giá 8tr/th.\n- Thiết kế gồm 3PN, 2WC.\n\n- Giao nhà hoàn thiện:\n+ Full bộ bếp và tủ bếp cao cấp.\n+ Full sàn gỗ chuẩn Châu Âu trị.\n+ Full thiết bị vệ sinh ToTo.\n+ Thiết bị thông minh smarthome.\n+ Thiết bị truy cập internet an toàn cho trẻ em.\n\n- Tiện ích nội khu đầy đủ công viên sân vườn, khu BBQ, shophouse,...\nĐầy đủ tiện nghi, rộng rãi thoáng mát,...', 1010, 11, 8000000, 'ef6cf6995b9056809c100ebef1f34b18-2748855317191474785.jpg', 2, '18 Kha Vạn Cân, phường An Bình, thị xã Dĩ An, Bình Dương', '10.86765,106.76222', '[{\"id\":\"size\",\"value\":\"85 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"},{\"id\":\"rooms\",\"value\":\"3 PN\",\"label\":\"S\\u1ed1 ph\\u00f2ng ng\\u1ee7\"}]', '2022-06-21 23:13:46'),
(5475, 96206990, 2147483647, 'Cho thuê MT 380 Nguyễn Tri Phương , P4 , Quận 10', 'Cho thuê MT 380 Nguyễn Tri Phương , P4 , Quận 10 \nDiện tích 7 x 20m kết cấu 1 trệt 1 lầu trống suốt , đoạn ngay chè thái Ý Phương , gần đại học Kinh Tế , khu vực nhiều ngân hàng , nhà hàng , cafe , showroom , trung tâm ngoại ngữ ...\nGiá thuê 48 triệu / tháng \nLiên hệ A Tân', 1030, 105, 48000000, 'beda84d574aa09923f3a1b1dad0b0224-2778002588095158562.jpg', 0, '', '10.76389,106.66799', '[{\"id\":\"size\",\"value\":\"140 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:13:46'),
(5476, 96209236, 2147483647, 'Phòng trọ Trần Huy Liệu/ Phú Nhuận', 'Mình cần nhượng lại 1 phòng lầu 4 Trần Huy Liệu quận Phú Nhuận ạ\n- nhà có thang máy\n- có ban công, cửa sổ lớn\n- có máy giặt, sấy luôn khỏi phơi =))\n- phòng đầy đủ giường, nệm, gối, máy lạnh, tủ lạnh, bếp điện từ, bàn, ghế, tủ blabla ạ\n- chỉ tính điện 4k, nước 100k 1 người, không chi phí gì thêm\nHợp đồng còn 8 tháng, nếu ở 1 mình hỗ trợ 6 tháng đầu còn 6tr5, 2 tháng cuối 7tr ạ', 1050, 111, 6500000, '43a1790da8949e2ab7bc412757fdf933-2778017946110141177.jpg', 0, '', '10.798167,106.67362', '[{\"id\":\"size\",\"value\":\"25 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:14:01'),
(5477, 96209232, 2147483647, 'Cho thuê phòng giá rẻ, Q.Tân Bình, TP.HCM', 'Khu dân cư yên tĩnh, an ninh, thuận tiện di chuyển ra sân bay Tân Sơn Nhất (7phút)/ siêu thị Vinmart (3phút)/ chợ Phạm Văn Hai/Lăng (3 phút)/ trường học/ bệnh viện/ rạp chiếu phim/ bến xe bus,….\nPhòng ở lầu 1, có lối đi riêng lên phòng, không đi chung với chủ nhà, có sân phơi đồ. Buổi tối, để xe trong nhà (không tốn tiền gửi xe).\nPhòng mới, sạch sẽ, diện tích khoảng 30m2, có 2 cửa sổ đón gió, cửa sổ hướng ra ban công và cửa phòng hướng ra hành lang có thiết kế cửa sổ nên cực kỳ thoáng, mát và đặc biệt là rất sáng, ban ngày không cần dùng đèn.\nCó toilet riêng trong phòng, sẵn line truyền hình cáp, wifi.\nƯu tiên người đã đi làm, ở tối đa 2 người. Giá phòng: 3 triệu đồng (xin vui lòng miễn trả giá)\nLiên hệ chính chủ, cô Khanh ***/ chú Hạnh ***.', 1050, 112, 3000000, '307c638f3fb706ae1209c6e9d1e1e956-2778018070398900514.jpg', 0, '', '10.809355,106.66614', '[{\"id\":\"size\",\"value\":\"30 m\\u00b2\",\"label\":\"Di\\u1ec7n t\\u00edch\"}]', '2022-06-21 23:14:01');
